INSERT INTO `news` VALUES (11,'China vuelve a simular ataques a Taiwn en su ltima jornada de maniobras','china-vuelve-a-simular-ataques-a-taiwan-en-su','El Ministerio de Defensa Nacional taiwans asegur que se detectaron \"mltiples grupos\" de aviones, buques y drones operando alrededor del Estrecho de Formosa.','<p style=\"margin-left:0px;\"><strong>Taiwn</strong> denunci hoy de nuevo que el <strong>Ejrcito chino sigui simulando ataques tanto a la isla como a sus fuerzas navales</strong> durante la que debera ser la ltima jornada de maniobras militares organizadas por Pekn en represalia por la visita a Taipei de la presidenta del Congreso estadounidense, Nancy Pelosi.</p><p style=\"margin-left:0px;\">En un comunicado publicado en su pgina web, el Ministerio de Defensa Nacional taiwans asegur que, en la maana del domingo, <strong>detect \"mltiples grupos\" de aviones, buques y drones operando alrededor del Estrecho de Formosa.</strong></p><p style=\"margin-left:0px;\">Segn el documento, las fuerzas chinas continuaran \"llevando a cabo ejercicios conjuntos por mar y aire, simulando ataques contra la isla de Taiwn y contra nuestros buques en el mar\", al tiempo que grupos de aviones \"infestan\" otras islas controladas por Taipi.</p><p style=\"margin-left:0px;\">Poco despus, la agencia oficial de noticias china Xinhua inform de que las maniobras de este domingo se centraban en \"probar las capacidades de fuego conjunto para ataques terrestres y ataques areos de largo alcance\".</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><h2 style=\"margin-left:0px;\">VUELTA A LA NORMALIDAD MAANA?</h2><p style=\"margin-left:0px;\">En respuesta, al igual que durante las ltimas jornadas, las fuerzas taiwanesas desplegaron sus aeronaves y buques tras \"seguir de cerca la situacin del enemigo\".</p><p style=\"margin-left:0px;\">En la noche del sbado, la cartera castrense especific que hasta 20 aviones y 14 buques del Ejrcito Popular de Liberacin (EPL, el Ejrcito chino) participaron de las maniobras alrededor de Taiwn durante esa jornada.</p><p style=\"margin-left:0px;\">Los movimientos del EPL se enmarcan en los ejercicios militares que lleva a cabo desde el jueves y que, en principio, deberan finalizar hoy al medioda local.</p><p style=\"margin-left:0px;\">Pese a que, a la hora de la publicacin de este artculo, Pekn no haba confirmado el final de forma oficial, el principal aeropuerto de Taiwn, el de Taoyuan, asegur que todos los vuelos deberan volver a la normalidad maana.</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">Las maniobras han incluido fuego real y el lanzamiento de misiles de largo alcance.</p><p style=\"margin-left:0px;\">Estos ejercicios tienen lugar en seis zonas alrededor de la isla, una de ellas a unos 20 kilmetros de la costa de Kaohsiung, la principal ciudad del sur de Taiwn.</p>','https://chaimanoticias.s3.amazonaws.com/6dn26zca8l6y7pz4n.jpg',1,'2022-08-17 22:56:00','2022-08-29 17:03:00',23,7),(12,'Arroj a su beb para salvarlo: mujer muere tras ser atropellada por un tren en Argentina','arrojo-a-su-bebe-para-salvarlo:-mujer-muere-t','El lactante, de 4 meses, est internado en terapia intensiva luego de sufrir un golpe en la cabeza.','<p style=\"margin-left:0px;\"><strong>Una mujer de 26 aos fue atropellada por un tren</strong> en Crdoba, Argentina. La vctima, que iba con su hijo de 4 meses en brazos, lanz al beb para salvarlo.</p><p style=\"margin-left:0px;\">Segn dijo a <a href=\"https://eldoce.tv/sociedad/mujer-arrollada-tren-murio-arrojo-bebe-salvarlo-cordoba-circunvalacion-_134085\"><i><u>El Doce</u></i></a> la presidenta del centro vecinal Cooperativa Los Artesanos, Gabriela Gargate, la vctima&nbsp;identificada como<strong> Pamela, de nacionalidad peruana</strong> y mam de otra nia de 6 aos&nbsp;volva de llevar al pequeo a un recinto mdico.&nbsp;</p><p style=\"margin-left:0px;\">Regresando, no vio que el tren vena y la embisti. No toc bocina (...)<strong> Arroj al beb, pero el tren se la llev entre las ruedas</strong>, relat.</p><p style=\"margin-left:auto;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">El lactante se encuentra<strong> internado en terapia intensiva</strong> tras sufrir un golpe en la cabeza.</p><p style=\"margin-left:0px;\">La presidenta vecinal acus que<strong> en la zona del accidente no hay sealizacin</strong> y que por ello es peligrosos para las y los transentes.</p><p style=\"margin-left:0px;\"><strong>Todos los das los vecinos cruzan las vas</strong>&nbsp;para ir a hacer trmites o concurrir al colegio. <strong>Cruzan nios y adultos con bebs siempre por ac.</strong> El tren no para porque roban y tampoco tocan la bocina, seal.</p>','https://chaimanoticias.s3.amazonaws.com/6dn26zdwgl6y8jj1j.jpg',1,'2022-08-17 23:18:59','2022-08-25 17:13:10',23,7),(13,'Reto de TikTok: joven queda sorda tras detonacin de explosivo casero en Argentina','reto-de-tiktok:-joven-queda-sorda-tras-detona','La adolescente de 15 aos pas por el lado de un basurero sin saber que estallara.','<p style=\"margin-left:0px;\"><strong>Una adolescente de 15 aos qued sorda</strong> en Argentina luego de pasar por el lado de un cesto de basura que estall: contena un explosivo casero que formaba parte de un reto de <a href=\"https://www.24horas.cl/24horas/site/tag/port/all/tagport_393_1.html\"><strong>TikTok</strong></a> realizado por otros estudiantes.</p><p style=\"margin-left:0px;\">Segn consign <a href=\"https://tn.com.ar/sociedad/2022/08/17/por-un-reto-de-tiktok-alumnos-detonaron-un-explosivo-casero-en-la-escuela-y-dejaron-sorda-a-una-adolescente/\"><i><u>TN</u></i></a>, la joven&nbsp;identificada como Azul Zabaleta caminaba por una de las galeras del colegio Don Bosco <strong>cuando el basurero explot.</strong></p><p style=\"margin-left:0px;\">El padre de la vctima, Matas Zabaleta, relat que<strong> \"Azul estaba tirada en el piso, desvanecida del dolor.&nbsp;</strong>El trauma acstico le afect el equilibrio y no daba ms. Empec a recibir muchas llamadas y cuando veo que es del colegio, me preocup y tuve que pedir permiso para ir a buscarla.</p><p style=\"margin-left:auto;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">El pap de Azul dijo luego que<strong> la ambulancia nunca lleg</strong> y que debi cargarla en brazos para llevarla hasta un hospital. All, el personal mdico decidi dejarla internada para intervenirla quirrgicamente en tres ocasiones. Luego, explic Matas, la joven tuvo que someterse a una alta dosis de corticoides y a sesiones de cmara hiperbrica.</p><p style=\"margin-left:0px;\">Este mes y pico de sus tratamientos<strong>&nbsp;fue un calvario para ella,</strong> el hecho de someterse a los diferentes procedimientos. Sufri un montn, se perdi muchas cosas. <strong>Est muy mal,</strong> expres Matas.</p><h2 style=\"margin-left:0px;\"><strong>Prdida de la audicin</strong></h2><p style=\"margin-left:0px;\">Sobre su diagnstico, el padre coment que actualmente \"tiene una&nbsp;<strong>hipoacusia neurosensorial bilateral severa.</strong>&nbsp;<strong>Sufri la&nbsp;prdida del 96,4% de su audicin&nbsp;bilateral</strong> y deber usar implante coclear en ambos lados (...) Para resolver su problema, deber usar implante coclear, pero escucharemos a otros especialistas tambin\".</p><p style=\"margin-left:0px;\">Aquello, dijo, para Azul fue una noticia devastadora debido a que en el caso de usar implantes no podr volver a practicar deportes de contacto.&nbsp;Ella juega rugby y karate. Se desvive por los deportes que le gustan y si sucede, <strong>no va a poder jugar ms,</strong> indic.</p><p style=\"margin-left:auto;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><span class=\"image-inline ck-widget image_resized ck-widget_with-resizer ck-widget_selected\" style=\"width:754.195px;\" contenteditable=\"false\"><img src=\"https://www.24horas.cl/24horas/site/artic/20220817/imag/foto_0000000120220817063248/ru.jpg\"><div class=\"ck ck-reset_all ck-widget__resizer\" style=\"display: none;\"><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-left\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-left\"></div><div class=\"ck ck-size-view\" style=\"display: none;\"></div></div></span></p><p style=\"margin-left:0px;\">Adems, el pap acus que las autoridades de la escuela marplatense<strong> \"subestimaron lo que pas.</strong> No garantizan la seguridad del alumnado (...)&nbsp;No llamaron a la polica ni a la divisin de explosivos, no se hicieron los peritajes correspondientes con el instrumento casero, manipularon las cosas, no se resguard la escena.&nbsp;<strong>Subestimaron todo, hubo muchas irregularidades y no le dieron importancia a lo que pas\".</strong></p><p style=\"margin-left:0px;\"><strong>El establecimiento respondi posteriormente que an no ha logrado identificar a los autores del reto de TikTok, en el cual utiizan una botella y mezclan productos para generar una reaccin qumica.</strong></p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26zdwgl6y8pbeq.jpg',1,'2022-08-17 23:23:28','2022-08-17 23:24:25',23,7),(14,'Corea del Norte lanza dos misiles crucero al Mar Amarillo','corea-del-norte-lanza-dos-misiles-crucero-al-','Los servicios de inteligencia de Corea del Sur y Estados Unidos estn analizando el nuevo ensayo armamentstico norcoreano.','<p style=\"margin-left:0px;\"><strong>Corea del Norte dispar dos&nbsp;misiles crucero al Mar Amarillo&nbsp;</strong>(llamado mar del Oeste en las dos Coreas).</p><p style=\"margin-left:0px;\">Se trata del primer lanzamiento de misiles&nbsp;crucero por parte norcoreana desde el pasado enero. Los que <strong>fueron disparados desde Onchon</strong>, en la provincia de Pyongan del sur, segn fuentes citadas por Yonhap.</p><p style=\"margin-left:0px;\">Los servicios de inteligencia de <strong>Corea del Sur y Estados Unidos estn analizando el nuevo ensayo armamentstico norcoreano</strong> mientras mantienen su posicin de preparacin militar.</p><p style=\"margin-left:auto;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">Esto ocurre dos das despus que el presidente surcoreano, Yoon Suk-yeol, ofreciera un&nbsp;plan de ayuda econmica a Corea del Norte&nbsp;en caso de que el rgimen optara por la&nbsp;<strong>desnuclearizacin</strong>.&nbsp;</p><p style=\"margin-left:0px;\"><strong>El uso de los proyectiles lanzados por Corea del Norte en esta ocasin no est castigado por las sanciones de la ONU</strong>, que se centran en los misiles balsticos y los ensayos nucleares del rgimen.</p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26zdwgl6y8st1r.jpg',1,'2022-08-17 23:26:12','2022-08-23 04:27:59',23,7),(15,'VIDEO: nio interrumpe audiencia del Papa Francisco en el Vaticano y su reaccin se viraliza','video:-nino-interrumpe-audiencia-del-papa-fra','Un pequeo corri hasta la tarima donde el sumo Pontfice daba un discurso. La reaccin del Papa caus aplausos y ovacin entre los asistentes.','<p style=\"margin-left:0px;\">El registro de un pequeo nio acercndose al Papa Francisco <a href=\"https://www.24horas.cl/internacional/noticias/cantante-tuvo-un-incidente-con-su-menstracion-en-tv-peruana\">ha dado la vuelta al mundo</a>. Y es que el pequeo <strong>interrumpi</strong> la audiencia del mximo Pontfice en saln&nbsp;Pablo VI del Vaticano y se subi a la tarima para acercarse al lder catlico.</p><p style=\"margin-left:0px;\">Entre aplausos el Papa Francisco le pregunt <strong>al nio cmo estaba y si quera sentarse a su lado.</strong></p><p style=\"margin-left:0px;\"><strong>\"En la audiencia hablamos&nbsp; sobre el diogo entre mayores y jvenes, este nio ha sido valiente y se ha mantenido tranquilo\",</strong> exclam el pontfice entre la ovacin de los presentes.</p><p style=\"margin-left:0px;\">El registro incluso fue compartido en la cuenta oficial de <strong>Twitter del Vaticano.&nbsp;</strong></p><p style=\"margin-left:auto;\"><code>&lt;blockquote class=\"twitter-tweet\"&gt;&lt;p lang=\"es\" dir=\"ltr\"&gt;&amp;quot;En la audiencia de hoy hablamos del dilogo entre nios y ancianos&amp;quot;, afirm el Papa junto a un pequeo que se le acerc para saludarle &lt;a href=\"https://twitter.com/hashtag/PapaFrancisco?src=hash&amp;amp;ref_src=twsrc%5Etfw\"&gt;#PapaFrancisco&lt;/a&gt; &lt;a href=\"https://twitter.com/hashtag/Audiencia?src=hash&amp;amp;ref_src=twsrc%5Etfw\"&gt;#Audiencia&lt;/a&gt; &lt;a href=\"https://twitter.com/hashtag/vejez?src=hash&amp;amp;ref_src=twsrc%5Etfw\"&gt;#vejez&lt;/a&gt; &lt;a href=\"https://t.co/4sL53QR2n0\"&gt;pic.twitter.com/4sL53QR2n0&lt;/a&gt;&lt;/p&gt;&amp;mdash; Vatican News (@vaticannews_es) &lt;a href=\"https://twitter.com/vaticannews_es/status/1559811905878986752?ref_src=twsrc%5Etfw\"&gt;August 17, 2022&lt;/a&gt;&lt;/blockquote&gt; &lt;script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"&gt;&lt;/script&gt;</code></p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><strong>Revisa el video completo del momento:</strong></p><figure class=\"media ck-widget ck-widget_selected\" contenteditable=\"false\"><div class=\"ck-media__wrapper\" data-oembed-url=\"https://youtu.be/wamAsThLRGs\"><div style=\"position: relative; padding-bottom: 100%; height: 0; padding-bottom: 56.2493%;\"><iframe src=\"https://www.youtube.com/embed/wamAsThLRGs\" style=\"position: absolute; width: 100%; height: 100%; top: 0; left: 0;\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen=\"\"></iframe></div></div><div class=\"ck ck-reset_all ck-widget__type-around\"><div class=\"ck ck-widget__type-around__button ck-widget__type-around__button_before\" title=\"Insertar prrafo antes del bloque\"><svg xmlns=\"http://www.w3.org/2000/svg\" viewBox=\"0 0 10 8\"><path d=\"M9.055.263v3.972h-6.77M1 4.216l2-2.038m-2 2 2 2.038\"></path></svg></div><div class=\"ck ck-widget__type-around__button ck-widget__type-around__button_after\" title=\"Insertar prrafo despus del bloque\"><svg xmlns=\"http://www.w3.org/2000/svg\" viewBox=\"0 0 10 8\"><path d=\"M9.055.263v3.972h-6.77M1 4.216l2-2.038m-2 2 2 2.038\"></path></svg></div><div class=\"ck ck-widget__type-around__fake-caret\"></div></div></figure><div class=\"ck-fake-selection-container\" style=\"position: fixed; top: 0px; left: -9999px; width: 42px;\">Widget de contenido multimedia</div>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26zdwgl6y8xelg.jpg',1,'2022-08-17 23:29:46','2022-08-23 04:27:05',23,7),(16,'No descartan intencionalidad: investigan muertes de cinco bebs en un hospital cordobs','no-descartan-intencionalidad:-investigan-muer','Las primeras alertas fueron planteadas por las autoridades del hospital que el Ministerio de Salud cordobs inform que preventivamente apart de su cargo, quienes denunciaron dos muertes en las que encontraron inconsistencias.','<p style=\"margin-left:0px;\">Madres y familiares de bebs fallecidos de forma sospechosa en el <strong>Hospital Materno Neonatal de la provincia argentina de Crdoba</strong>&nbsp;se manifestaron este martes para exigir explicaciones frente a la institucin donde presuntamente ocurrieron los hechos que conmocionan a la sociedad cordobesa.</p><p style=\"margin-left:0px;\">El fiscal del caso, Ral Garzn, investiga las muertes de <strong>por lo menos cinco bebs ocurridas en forma sospechosa entre finales de marzo y junio pasados</strong>, en un caso en el que no se descarta mala praxis ni intencionalidad.</p><p style=\"margin-left:0px;\">Las primeras alertas fueron planteadas por las autoridades del hospital que el Ministerio de Salud cordobs inform que preventivamente apart de su cargo, quienes denunciaron<strong> dos muertes en las que encontraron inconsistencias.</strong></p><p style=\"margin-left:auto;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">Luego, un ciudadano puso en conocimiento de la Justicia que <strong>existan ms muertes sospechosas</strong>, inform el fiscal a los medios.</p><p style=\"margin-left:0px;\">El caso se encuentra hoy en secreto de sumario, inform el Gobierno cordobs. El fiscal espera la <strong>evaluacin mdica de los antecedentes</strong> y el servicio de salud del Hospital Materno Neonatal se desarrolla con normalidad, inform la Fiscala.</p><p style=\"margin-left:0px;\">El Gobierno de Crdoba se constituy como querellante y se puso a <strong>disposicin total de brindar cualquier elemento que requiera la Fiscala</strong> mientras brinda asistencia de acompaamiento a los familiares, segn inform el domingo ltimo.</p><p style=\"margin-left:0px;\">Vanesa, la madre de un beb fallecido el 18 de marzo pasado, consider \"una burla\" que el Gobierno provincial se constituya como querellante: \"Nos da mucha impotencia porque <strong>son uno de los que tienen que salir a dar explicaciones\",</strong> dijo llorando a Eldoce.tv en la marcha frente al hospital.</p><p style=\"margin-left:auto;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">Por ser el primer caso, Vanesa se fue pensando que <strong>fue una desgracia, pero las cosas cambiaron</strong> y seal que podra <strong>haberse evitado la muerte de otros bebs.</strong></p><p style=\"margin-left:0px;\">Los familiares portaban carteles que decan Justicia y verdad, Queremos respuestas, Justicia por todos los angelitos, No al silencio cmplice.</p><p style=\"margin-left:0px;\">Desde ac tendramos que haber salido con nuestros hijos, insisti Vanesa.&nbsp;</p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26zdwgl6y9eejb.jpg',1,'2022-08-17 23:42:59','2022-08-23 16:16:48',23,7),(17,'Hijo de Zalo Reyes afirma que muerte de su padre \"fue como l la so siempre\" y que ser velado en gimnasio de Conchal','hijo-de-zalo-reyes-afirma-que-muerte-de-su-pa','\"Su muerte fue como l la so siempre, calientito, durmiendo y como un rey, se qued dormido y le fall su corazn\", confirm a 24 Horas, Boris Gonzlez, hijo de Zalo Reyes.','<p style=\"margin-left:0px;\">El hijo de <strong>Zalo Reyes,</strong> Boris Gonzlez, convers con&nbsp;<strong>24 Horas&nbsp;</strong>tras la <a href=\"https://www.24horas.cl/actualidad/nacional/muere-zalo-reyes-a-los-69-anos-su-hijo-confirmo-la-defuncion\">reciente muerte de su padre,</a> el reconocido cantante nacional.</p><p style=\"margin-left:0px;\">El tambin manager del fallecido artista, coment que <strong>\"ha</strong>c<strong>e tres o cuatro das,</strong> sabamos que se vena lo peor pero siempre uno con la esperanza, porque muchas veces le pasaron cosas, <strong>pero siempre sali adelante\".</strong></p><p style=\"margin-left:0px;\">\"Hoy ya lleg el momento a las 4 de la tarde. <strong>Su muerte fue como l la so siempre, calientito, durmiendo y como un rey, se qued dormido y le fall su corazn.</strong> Fue una muerte soada y a la edad que l quera, l no quera vivir ms, toda la vida dijo yo a los 60, 65 o 70 aos feliz... y en tres meses ms cumplia 70\", sostuvo Boris Gonzlez.</p><p style=\"margin-left:auto;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">Por otra parte, agradeci el cario y homenaje de las personas. <strong>\"Siempre lo quisieron, lo aplaudieron y amaron, toda la vida lo homenajearon\",</strong> aadi Boris. De igual manera coment la calle que lleva su nombre en su comuna oriunda, Conchal, \"<strong>fue un tremendo homenaje que lo vivi en vida\".</strong></p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">Bajo la misma lnea coment el legado musical que dej su padre. <strong>\"l nunca fall en sus principios, l deca no me cambi por nada y ac est en Conchal y muri en Conchal, nunca se crey el cuento\",</strong> asever Boris.</p><p style=\"margin-left:0px;\">En cuanto al velorio, el hijo del fallecido cantante, confirm a&nbsp;<strong>24 Horas,&nbsp;</strong>que se realizar en el gimnasio de Conchal.&nbsp;</p><p style=\"margin-left:auto;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">\"Al momento de fallecer uno va calculando que a lo mejor a nadie le va a interesar, pero las redes sociales explotaron. l merece estar en un lugar adecuado, <strong>lo vamos a hacer como l quera, en el gimnasio de Conchal,</strong> el gorrin tiene que estar ah\", afirm Boris.</p><p style=\"margin-left:0px;\">Finalmente detall que <strong>\"lo vamos a hacer con alegra, con msicos y banda como a l le gustaba, estn todos invitados\"</strong>, cerr el hijo del intrprete de \"Con una lgrima en la garganta\".</p>','https://chaimanoticias.s3.amazonaws.com/6dn26z1s4l74a2mez.jpg',1,'2022-08-22 04:48:26','2022-08-22 04:48:26',23,9),(18,'Alameda: 84 personas que ocupaban bandejn central con carpas fueron reubicadas','alameda:-84-personas-que-ocupaban-bandejon-ce','La totalidad de las personas que dejaron el sector fueron reubicadas en domicilios de familiares, en albergues o en hospederas.','<p style=\"margin-left:0px;\">La Municipalidad de Santiago, con la colaboracin de Carabineros, la <strong>Polica de Investigaciones (PDI)</strong> y la Seremi de Desarrollo Social, lograron este domingo a reubicar a<strong> 84 personas que ocupaban el bandejn central de la Alameda</strong> de manera irregular con carpas.<br><br>Hugo Cuevas, director de Desarrollo Comunitario del municipio, detall que de las <strong>84 personas que fueron desalojadas,</strong> 18 son nios y nias.</p><p><br><br>La totalidad de las personas que dejaron el sector fueron<strong> reubicadas en domicilios de familiares,</strong> en albergues o en hospederas.<br><br>Cuevas explic que <strong>cada una de las personas, tiene la posibilidad de contar con una atencin particular, con techo, con alimentacin y apoyo psicosocial en esos lugares.</strong></p><p><br>El titular de la Dideco agreg que <strong>el trabajo que hemos desarrollado en este sector no es solamente para retirar las carpas sino tambin para poder eliminar todo aquel enser que estaba instalado en este espacio.</strong></p><p style=\"margin-left:0px;\"><br>Indic que se seguir realizando este tipo de procedimiento y continuarn monitoreando. Dentro de los prximos das vamos a seguir muy atentos a la situacin que hoy da presentan las personas de los lugares donde hemos ido relocalizando, destac.<br><br>Aadi que el objetivo es <strong>recuperar Santiago y recuperar tambin el espacio pblico.</strong></p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26z1s4l74a8kzl.jpg',1,'2022-08-22 04:53:04','2022-08-31 16:26:17',23,9),(19,'Lluvias y fuerte baja de temperaturas: el pronstico para lo prximos das en Santiago','lluvias-y-fuerte-baja-de-temperaturas:-el-pro','La Direccin Meteorolgica de Chile prev chubascos aislados para una jornada.','<p style=\"margin-left:0px;\">La Direccin Meteorolgica de Chile pronostic una <a href=\"https://www.24horas.cl/24horas/site/tag/port/all/tagport_870_1.html\"><strong>baja de temperatura</strong></a> para los prximos das en la regin Metropolitana. Adems, se prevn chubascos aislados para el jueves.</p><p style=\"margin-left:0px;\">Segn prev el organismo, este <strong>mircoles</strong> estar con cielo cubierto y nublado, con una mxima de 14 y una mnima de 6.</p><p style=\"margin-left:0px;\">En tanto, para el<strong> jueves</strong> se pronostican algunos <strong>chubascos aislados</strong> durante la maana, en una jornada que tendr una mxima de 11 y mnima de 6.</p><p style=\"margin-left:auto;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">Ya para el <strong>viernes</strong> se prev cielo despejado, una mxima de 16 y mnima de 2; y para el<strong> sbado</strong> de mxima de 21 y mnima de 3.</p><p style=\"margin-left:0px;\"><span class=\"image-inline ck-widget image_resized ck-widget_with-resizer ck-widget_selected\" style=\"width:754.195px;\" contenteditable=\"false\"><img src=\"https://www.24horas.cl/24horas/site/artic/20220906/imag/foto_0000000120220906094927/asd.jpg\"><div class=\"ck ck-reset_all ck-widget__resizer\" style=\"display: none;\"><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-left\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-left\"></div><div class=\"ck ck-size-view\" style=\"display: none;\"></div></div></span></p>','https://chaimanoticias.s3.amazonaws.com/6dn26z1qcl7r3x0jr.jpg',1,'2022-09-07 04:14:52','2022-09-07 04:14:52',19,9),(20,'A los 80 aos muere el exalcalde de Via del Mar y exdiputado Rodrigo Gonzlez','a-los-80-anos-muere-el-exalcalde-de-vina-del-','La noticia fue confirmada por el actual presidente de la Cmara de Diputadas y Diputados, Ral Soto, quien envi sus condolencias a la familia del exparlamentario.','<p style=\"margin-left:0px;\">Este domingo se confirm la muerte&nbsp;<strong>Rodrigo Gonzlez</strong>, ex alcalde de Via del Mar y ex diputado, quien falleci a sus <strong>80 aos.</strong></p><p style=\"margin-left:0px;\">La noticia fue confirmada por el actual presidente de la Cmara de Diputadas y Diputados, <strong>Ral Soto</strong>, quien envi sus condolencias a la familia del ex vicepresidente de la Cmara Baja.&nbsp;</p><p style=\"margin-left:0px;\">\"Lamento informar <strong>el sensible fallecimiento de un gran amigo y compaero</strong>, ex diputado y ex vicepresidente de la Cmara,&nbsp;Rodrigo Gonzlez\", dijo a travs de Twitter.</p><p style=\"margin-left:0px;\">\"<strong>Nuestras condolencias a la familia, amigos y seres queridos</strong> y a toda la comunidad con la cual trabaj incansablemente hasta su ltimo da\", agreg.&nbsp;</p><p style=\"margin-left:auto;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgb(255,255,255);color:rgb(136,153,166);\"><code>&lt;blockquote class=\"twitter-tweet\"&gt;&lt;p lang=\"es\" dir=\"ltr\"&gt;Lamento informar el sensible fallecimiento de un gran amigo y compaero, ex diputado y ex Vice Presidente de la &lt;a href=\"https://twitter.com/Camara_cl?ref_src=twsrc%5Etfw\"&gt;@Camara_cl&lt;/a&gt; Rodrigo Gonzlez. Nuestras condolencias a la familia, amigos y seres queridos y a toda la comunidad con la cual trabaj incansablemente hasta su ltimo da.&lt;/p&gt;&amp;mdash; Raul Soto Diputado (@Raul_Soto1) &lt;a href=\"https://twitter.com/Raul_Soto1/status/1566505279319154688?ref_src=twsrc%5Etfw\"&gt;September 4, 2022&lt;/a&gt;&lt;/blockquote&gt; &lt;script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"&gt;&lt;/script&gt;</code></span></p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">En esta misma lnea, la <strong>ministra de Defensa Nacional, Maya Fernndez</strong>, le envi sus \"condolencias para la familia y amigos\".</p><p style=\"margin-left:0px;\">Adems, la autoridad coment que \"<strong>me toc compartir con l y tener largas conversaciones</strong>\".</p><p style=\"margin-left:auto;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgb(255,255,255);color:rgb(136,153,166);\"><code>&lt;blockquote class=\"twitter-tweet\"&gt;&lt;p lang=\"es\" dir=\"ltr\"&gt;Mis condolencias para la familia y amig@s&lt;br&gt;Me toco compartir con l y tener largas conversaciones &lt;a href=\"https://t.co/udqTNVwlvG\"&gt;https://t.co/udqTNVwlvG&lt;/a&gt;&lt;/p&gt;&amp;mdash; Maya Fernandez Allende (@Mayafernandeza) &lt;a href=\"https://twitter.com/Mayafernandeza/status/1566508086755459075?ref_src=twsrc%5Etfw\"&gt;September 4, 2022&lt;/a&gt;&lt;/blockquote&gt; &lt;script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"&gt;&lt;/script&gt;</code></span></p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">Por su parte, la senadora <strong>Yasna Provoste</strong> expres en su cuenta de Twitter que \"con profunda pena despedimos a Rodrigo Gonzlez\".</p><p style=\"margin-left:0px;\">Segn coment la legisladora, el exparlamentario fue un \"<strong>gran servidor del pueblo y de las regiones</strong>. Mis condolencias a su querida familia, amigos y amigas, y a toda su militancia\".</p><p style=\"margin-left:auto;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgb(255,255,255);color:rgb(136,153,166);\"><code class=\"ck-code_selected\">&lt;blockquote class=\"twitter-tweet\"&gt;&lt;p lang=\"es\" dir=\"ltr\"&gt;Con profunda pena despedimos a Rodrigo Gonzlez. Ex diputado, ex vicepresidente de la &lt;a href=\"https://twitter.com/Camara_cl?ref_src=twsrc%5Etfw\"&gt;@Camara_cl&lt;/a&gt;, gran servidor del pueblo y de las regiones. Mis condolencias a su querida familia, amigos y amigas, y a toda su militancia &lt;a href=\"https://twitter.com/PPD_Chile?ref_src=twsrc%5Etfw\"&gt;@PPD_Chile&lt;/a&gt;.&lt;/p&gt;&amp;mdash; Yasna Provoste Campillay (@ProvosteYasna) &lt;a href=\"https://twitter.com/ProvosteYasna/status/1566508589971148800?ref_src=twsrc%5Etfw\"&gt;September 4, 2022&lt;/a&gt;&lt;/blockquote&gt; &lt;script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"&gt;&lt;/script&gt;</code></span></p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><h3 style=\"margin-left:0px;\">Carrera poltica</h3><p style=\"margin-left:0px;\">Rodrigo Gonzlez dedic gran parte de su vida a la poltica, <strong>siendo diputado por el&nbsp;7 Distrito en la regin de Valparaso, durante el perodo 2018-2022.&nbsp;</strong></p><p style=\"margin-left:0px;\"><strong>Asimismo, se desempe como vicepresidente de la Cmara Baja </strong>desde&nbsp;el 7 de abril de 2020 hasta el 11 de marzo de 2022.</p>','https://chaimanoticias.s3.amazonaws.com/6dn26zbx8l7r5f1s8.jpg',1,'2022-09-07 04:56:54','2022-09-07 04:56:54',19,9),(21,'Incendio afecta instalaciones del Hospital Psiquitrico El Peral','incendio-afecta-instalaciones-del-hospital-ps','Segn informacin preliminar, no se reportan pacientes ni personal heridos. La ministra de Salud lament el siniestro, asegurando que \"lo importante es que no existen funcionarios ni pacientes comprometidos\".','<p>Durante la noche de este viernes, <strong>se registr un incendio en el&nbsp;Hospital Psiquitrico El Peral</strong>, situado en <strong>Puente Alto, Regin Metropolitana</strong>.</p><p>Usuarios de las redes sociales compartieron registros del siniestro en el establecimiento de salud ubicado en la interseccin de las Avenidas Camilo Henrquez con El Pen. <strong>Personal de Bomberos lleg al lugar para combatir las llamas</strong>.</p><p style=\"margin-left:0px;\">De acuerdo a informacin preliminar, <strong>no se registran heridos</strong> y <strong>Transporte Informa detall que el hecho \"no afecta la circulacin vehicular\" del sector mencionado</strong>.</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><blockquote><p style=\"margin-left:0px;\"><i>(20.20) ATENTOS: Incendio en dependencias de Hospital Siquitrico El Peral, no afecta la circulacin vehicular por Camilo Henrquez/El Pen y alrededores. Circule con normalidad, no disminuya velocidad, evite fotografiar o grabar, mantngase atento a la conduccin </i><a href=\"https://twitter.com/hashtag/PuenteAlto?src=hash&amp;ref_src=twsrc^tfw\"><i>#PuenteAlto</i></a><i> </i><a href=\"https://t.co/SceQND9Hox\"><i>https://t.co/SceQND9Hox</i></a></p><p><i> TransporteInforma Regin Metropolitana De Santiago (@TTISantiago) </i><a href=\"https://twitter.com/TTISantiago/status/1565858092100763648?ref_src=twsrc^tfw\"><i>September 3, 2022</i></a></p></blockquote><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">Al respecto, la ministra de Salud Begoa Yarza, lament el incendio asegurando que <strong>\"lo importante es que no existen funcionarios ni pacientes comprometidos,</strong> ya que la parte afectada del centro asistencial es un lugar abandonado del recinto. Investigaremos los hechos\".</p><p style=\"margin-left:0px;\"><br><br data-cke-filler=\"true\"></p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26zbx8l7r5o6he.jpg',1,'2022-09-07 05:03:58','2022-09-07 05:03:58',19,9),(22,'Anuncian corte de agua en sectores de Puente Alto','anuncian-corte-de-agua-en-sectores-de-puente-','Aguas Andinas inform que la suspensin del suministro ser desde las 22:00 horas de este viernes hasta las 06:00 horas de este sbado. ','<p style=\"margin-left:0px;\"><strong>Aguas Andinas</strong> inform a travs de sus redes sociales que&nbsp;<strong>habr corte del suministro&nbsp;</strong>en un <strong>\"sector acotado\"</strong> de la comuna de Puente Alto.</p><p style=\"margin-left:0px;\">Segn detall la compaa la suspensin del suminsitro se debe<strong> \"a una incidencia en la red de agua potable\".&nbsp;</strong></p><p style=\"margin-left:0px;\">Asimismo declararon que el corte ser&nbsp;<strong>desde las 22:00 horas de este viernes hasta las 06:00 horas de este sbado.&nbsp; </strong>Los sectores afectados sern desde Nonato Coo y paralelo a Avenido Mxico.&nbsp;</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><strong>Revisa el detalle:</strong></p><p style=\"margin-left:0px;\"><span class=\"image-inline ck-widget ck-widget_with-resizer\" contenteditable=\"false\"><img src=\"https://www.24horas.cl/24horas/site/artic/20220902/imag/foto_0000000120220902201344.jpg\"><div class=\"ck ck-reset_all ck-widget__resizer\" style=\"display: none;\"><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-left\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-left\"></div><div class=\"ck ck-size-view\" style=\"display: none;\"></div></div></span></p><p><br data-cke-filler=\"true\"></p><p><br data-cke-filler=\"true\"></p><p><br data-cke-filler=\"true\"></p><p><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">No obstante contarn con servicio de suministro para las personas afectadas.&nbsp;</p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26zbx8l7r5rog8.jpg',1,'2022-09-07 05:06:42','2022-09-07 05:06:42',19,9),(23,'Imacec de julio crece un 1%, desempeo ms bajo desde febrero del 2021','imacec-de-julio-crece-un-1percent-desempeno-m','La economa chilena anot el tercer mes consecutivo a la baja, de acuerdo a cifras del Banco Central.','<p style=\"margin-left:0px;\">El <strong>Banco Central</strong> inform este jueves el <strong>ndicador Mensual de Actividad Econmica (Imacec)</strong> de julio, el cual consign un alza del 1%, siendo este el <strong>peor desempeo registrado desde febrero del 2021.</strong></p><p style=\"margin-left:0px;\">Segn dijo el organismo, la <strong>serie desestacionalizada</strong> cay 1,1% respecto del mes precedente y aument 0,2% en 12 meses.</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><strong>Cabe sealar que el mes registr la misma cantidad de das hbiles que julio de 2021.</strong></p><p style=\"margin-left:0px;\">La situacin consignada en julio implic el tercer mes consecutivo en que la economa nacional presenta una baja en cuanto a su expansin.</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">El aumento del<strong> Imacec</strong> se explic principalmente por las actividades de servicios. En contraste, el comercio y la minera cayeron, compensando parcialmente el resultado anterior.</p><p style=\"margin-left:0px;\"><strong>Anlisis del Imacec por actividad</strong></p><p style=\"margin-left:0px;\"><strong>1. Produccin de bienes</strong></p><p style=\"margin-left:0px;\">La produccin de bienes cay 1,8%, resultado explicado por el desempeo de la minera y la industria, que presentaron variaciones de -6,4% y -3,9%, respectivamente. En contraste, el resto de bienes present un crecimiento de 3,0%.</p><p style=\"margin-left:0px;\">En trminos desestacionalizados, la produccin de bienes cay 1,1% respecto del mes anterior, incidido por el resultado de la minera y la industria. Compens en parte este resultado, el crecimiento del resto de bienes.</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><blockquote><p style=\"margin-left:0px;\"><i>Banco Central de Chile public el </i><a href=\"https://twitter.com/hashtag/Imacec?src=hash&amp;ref_src=twsrc^tfw\"><i>#Imacec</i></a><i> de julio 2022 en su sitio web. Link a la nota completa en: </i><a href=\"https://t.co/jLihNWhRES\"><i>https://t.co/jLihNWhRES</i></a><i> </i><a href=\"https://t.co/jxoXxNQZVg\"><i>pic.twitter.com/jxoXxNQZVg</i></a></p><p><i> Banco Central de Chile (@bcentralchile) </i><a href=\"https://twitter.com/bcentralchile/status/1565317831973109764?ref_src=twsrc^tfw\"><i>September 1, 2022</i></a></p></blockquote><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><strong>2. Comercio</strong></p><p style=\"margin-left:0px;\">La actividad comercial present una disminucin de 11,1%, resultado explicado por todos sus componentes. Destacaron las menores ventas minoristas en establecimientos especializados de vestuario, calzado y equipamiento domstico y en grandes tiendas, y las mayoristas de maquinaria y equipo, y enseres domsticos.</p><p style=\"margin-left:0px;\">En tanto, las cifras desestacionalizadas mostraron una variacin de -0,4% respecto del mes precedente.</p><p style=\"margin-left:0px;\"><strong>3. Servicios</strong></p><p style=\"margin-left:0px;\">Los servicios crecieron un 6,3%, resultado explicado principalmente por el desempeo de los servicios personales, en particular de salud. Tambin destac el aporte del transporte y los servicios empresariales.</p><p style=\"margin-left:0px;\">Acorde con cifras ajustadas por estacionalidad, las actividades de servicios presentaron una cada de 1,7% respecto del mes anterior. Este resultado fue incidido por menores servicios de educacin.</p><p style=\"margin-left:0px;\">Considerando los desafos que la crisis sanitaria ha impuesto sobre la recoleccin de datos bsicos, el Banco Central de Chile ha hecho esfuerzos adicionales con sus proveedores de informacin para minimizar el impacto en la calidad de las estadsticas. Sin embargo, es relevante sealar que las cifras entregadas en esta oportunidad podran estar sujetas a mayores revisiones que las registradas histricamente, las cuales sern difundidas de acuerdo con el calendario de publicaciones y revisiones de Cuentas Nacionales disponible en la pgina web institucional.</p>','https://chaimanoticias.s3.amazonaws.com/6dn26zeo4l7r7vslm.jpg',1,'2022-09-07 06:05:52','2022-09-07 06:05:52',19,15),(24,'Banco Central sube la tasa de inters de poltica monetaria en 100 puntos base, alcanzando un 10,75%','banco-central-sube-la-tasa-de-interes-de-poli','Segn indic el Consejo de la institucin monetaria, esta nueva cifra se ubica en torno \"al nivel mximo que considera el escenario central del IPoM de septiembre\". ','<p>El <strong>Consejo del Banco Central</strong>&nbsp;decidi incrementar en 100 puntos base la<strong> tasa de inters de poltica monetaria</strong> (TPM), <strong>subiendo desde un 9,75% hasta un 10,75%.</strong></p><p>A travs de un comunicado, la entidad indic que desde el anuncio de intervencin en julio pasado las tensiones en el mercado cambiario han disminuido, lo cual se ha visto reflejado en que la volatilidad ha descendido y el tipo de cambio se ha apreciado.</p><p>Las tasas de inters de largo plazo se ubican en niveles similares aunque con fluctuaciones a los de la Reunin previa, mientras que la bolsa ha acumulado ganancias. <strong>El crdito contina con un dbil dinamismo, en un contexto en que bancos y empresas consideran que las condiciones financieras son restrictivas</strong>, explic.</p><p><br data-cke-filler=\"true\"></p><p>En esa misma lnea, la autoridad monetaria sostuvo que la actividad ha seguido su proceso de ajuste tras los fuertes desequilibrios acumulados en 2021.</p><p><strong>Los datos del segundo trimestre mostraron un retroceso de 0,5% del PIB no minero serie desestacionalizada respecto del trimestre precedente.</strong> Esta tendencia se mantuvo en julio, mes en el cual el Imacec no minero decreci 0,8% mensualmente en su serie desestacionalizada, aadi.</p><p>En tanto, desde el lado del gasto los datos datos del segundo trimestre arrojaron cadas tanto en la inversin como en el consumo.</p><p><br data-cke-filler=\"true\"></p><p><strong>El mercado laboral ha perdido fuerza, observndose una baja creacin de empleo y un descenso en las vacantes.</strong> La tasa de desempleo no muestra mayores cambios. La variacin anual de los salarios reales se mantiene en niveles negativos. <strong>Los indicadores de confianza de los consumidores y de las empresas siguen en terreno pesimista</strong>, afirm el Consejo.</p><p><br data-cke-filler=\"true\"></p><p>Cabe mencionar que con esta decisin,<strong> la TPM se ubica en torno al nivel mximo</strong> que considera el escenario central del IPoM de septiembre.</p><p><strong>Los prximos movimientos de la tasa dependern de la evolucin del escenario macroeconmico y sus implicancias para la convergencia de la inflacin a la meta.</strong> El Consejo permanecer especialmente atento a los riesgos al alza para la inflacin, tanto por el elevado nivel que sta ha alcanzado como por el hecho de que las expectativas de inflacin a dos aos plazo siguen por sobre 3%, agregan.</p>','https://chaimanoticias.s3.amazonaws.com/6dn26zf44l7r8ope2.jpg',1,'2022-09-07 06:28:23','2022-09-07 06:28:23',19,15),(25,'Aguinaldo de Fiestas Patrias: Cunto es, quines lo reciben y cundo se paga?','aguinaldo-de-fiestas-patrias:-cuanto-es-quien','La entrega de este beneficio, que tambin incluye a las y los pensionados, est regulada por una ley que define una serie de requisitos laborales para su obtencin.','<p>Septiembre est a la vuelta de la esquina. Y es que junto con la llegada de la primavera, tambin est la celebracin de <a href=\"https://www.chvnoticias.cl/tag/fiestas-patrias/\"><strong>Fiestas Patrias</strong></a>, que luego de dos aos sin presencialidad por la pandemia, vuelven en gloria y majestad.</p><p>En ese contexto, uno de los aportes ms esperados del ao es el ya tradicional <a href=\"https://www.chvnoticias.cl/tag/aguinaldo/\"><strong>aguinaldo</strong></a>, que es entregado anualmente a los y las pensionadas, as como tambin a trabajadores que cumplan con ciertos requisitos.</p><p>Una ayuda a la que pueden acceder tanto trabajadores del sector pblico, como quienes trabajen en el sector privado, pero en este caso su entrega <strong>depende directamente del empleador</strong>.</p><p><br data-cke-filler=\"true\"></p><p>El beneficio econmico, que llega a aliviar los bolsillos de las y los chilenos en medio del aumento en la <a href=\"https://www.chvnoticias.cl/tag/inflacion/\"><strong>inflacin</strong></a>, <strong>no es imponible ni tributable</strong>. Esto quiere decir que no est afecto a descuentos ni impuestos, por lo tanto, <strong>se otorga de forma manera ntegra</strong> ya sea en la pensin de septiembre, en el sueldo o como adelanto.</p><h2><strong>Quines reciben el aguinaldo de Fiestas Patrias?</strong></h2><p>Como se mencion, el aguinaldo de Fiestas Patrias lo reciben los y las pensionadas, trabajadores del sector privado y pblico. En este ltimo caso, de acuerdo a lo que especifica la <a href=\"https://www.bcn.cl/leychile/navegar?idNorma=1170283\">Ley 21.405</a>, los funcionarios del<strong> sector pblico que se desempeen en cargos de planta o a contrata</strong> en las siguientes instituciones, sern quienes reciban este aguinaldo:</p><ul><li>Universidades estatales regidas por la Ley 21.094.</li><li>Establecimientos de educacin parvularia financiados por la Junta Nacional de Jardines Infantiles (Junji).</li><li>Asistentes de la educacin pblica y/o profesionales de la educacin que se desempeen en establecimientos educacionales dependientes de los servicios locales de educacin pblica.</li><li>Astilleros y Maestranzas de la Armada,&nbsp;de Fbricas y Maestranzas del Ejrcito y de la Empresa Nacional de Aeronutica de Chile.</li><li>Sectores de la Administracin del Estado que hayan sido traspasados a las municipalidades.</li><li>Establecimientos particulares de enseanza subvencionados por el Estado.</li><li>Establecimientos de educacin Tcnico Profesional.</li><li>Instituciones reconocidas como colaboradoras del Servicio Nacional de Menores (Sename) o su continuador legal.</li><li>Corporaciones de Asistencia Judicial -excluye a funcionarios de la Corte Suprema pertenecientes a los grados I y II de la escala del personal superior del Poder Judicial ni para el Contralor General de la Repblica-.</li><li>Tribunales tributarios y aduaneros.</li><li>Trabajadores de empresas y entidades del Estado que no negocien colectivamente.</li></ul><p><br data-cke-filler=\"true\"></p><h2><strong>Cul es el monto en el sector pblico?</strong></h2><p>El <strong>monto del aguinaldo depende directamente del salario</strong> del trabajador o trabajadora.</p><p><br data-cke-filler=\"true\"></p><ul><li>Para los trabajadores cuya remuneracin lquida de agosto de 2022 sea igual o inferior a $842.592,&nbsp;el <strong>aguinaldo ser de $81.196</strong>.</li><li>Para quienes tengan una remuneracin lquida de agosto de 2022 superior a los $842.592, el <strong>aguinaldo ser de $56.365</strong>.</li></ul><p><a href=\"https://drive.google.com/file/d/1ISjhFQxLib7hoGX03QhvXKyo-J7cEsZC/view\">Segn contempla la ley</a>, se entender como remuneracin lquida el total de las de carcter permanente correspondientes a dicho mes, <strong>excluidas las bonificaciones, asignaciones y bonos asociados al desempeo individual, colectivo o institucional</strong>; con la sola deduccin de los impuestos y de las cotizaciones previsionales de carcter obligatorio.</p><p>En el caso de pensionadas y pensionados, el valor del aguinaldo, de acuerdo a lo que informa <a href=\"https://www.chileatiende.gob.cl/fichas/26553-aguinaldo-de-fiestas-patrias-para-pensionados-ips#:~:text=El%20monto%20base%20del%20aguinaldo%202022%20es%20de%2021.882%20pesos%20por%20pensionado.\">ChileAtiende</a>, es de $21.882 base, a lo que se suman $11.226 por cada carga familiar debidamente inscrita.</p><h2><strong>Aguinaldo para trabajadores del sector privado</strong></h2><p>En el caso de trabajadores y trabajadoras del sector privado,&nbsp;pueden recibir el aguinaldo de Fiestas Patrias pero<strong> con cargo a los empleadores</strong>, quienes <strong>no estn obligados</strong> a entregar esta ayuda. De todas formas, el dinero puede exigirse si es que est incluido dentro del<strong> contrato o si existe un convenio colectivo</strong> donde el beneficio est incorporado como clusula.</p><h2><strong>Cundo se paga el aguinaldo?</strong></h2><p><strong>La fecha especfica de pago del aguinaldo depende directamente de cundo recibas tu pensin o remuneracin</strong>. Sin embargo, este aporte debe estar incluido s o s en la pensin o sueldo correspondiente a septiembre.</p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26zf44l7r93l6d.jpg',1,'2022-09-07 06:39:55','2022-09-07 06:39:55',19,15),(27,'Aumenta monto del Aporte Canasta Bsica: Consulta con tu RUT y fecha de nacimiento si recibirs el pago','aumenta-monto-del-aporte-canasta-basica:-cons-l7r9u58d','El Instituto de Previsin Social realizar los pagos del aporte, cuyo monto se ajusta en base al IPC, hasta abril de 2023. Ac, el paso a paso del trmite.','<p>La <a href=\"https://www.desarrollosocialyfamilia.gob.cl/\">canasta bsica de alimentos</a> volvi a subir en julio (20,6%) llegando a costar <strong>$58.003</strong> y con la amenaza de que&nbsp;otras 200 mil personas podran caer en la pobreza.</p><p>Por eso, se hacen sumamente importantes los pagos del <a href=\"https://www.chvnoticias.cl/tag/aporte-canasta-basica/\">Aporte Canasta Bsica</a> por parte del <a href=\"https://www.ips.gob.cl/\">Instituto de Previsin Social</a> (IPS).</p><p>Si bien cuando se aprob el reajuste al salario mnimo se estableci que el monto del beneficio era <strong>$6.410</strong>, la cifra se ajusta mes a mes en base al <a href=\"https://www.chvnoticias.cl/tag/inflacion/\">IPC</a> y <strong>su entrega se extendi hasta abril de 2023.</strong></p><p><br data-cke-filler=\"true\"></p><p>Por esa razn, los beneficiarios se llevarn una sorpresa durante&nbsp;el mes de <strong>agosto</strong>, ya que <strong>aumentar el monto del aporte mensual compensatorio</strong> para enfrentar el incremento del costo de los productos que componen la canasta de alimentos.</p><h2><strong>Quines son beneficiarios?</strong></h2><p>El Subsidio Canasta Bsica es un <strong>beneficio no postulable</strong>, ya que <strong>se entrega de forma automtica</strong> a las siguientes personas:</p><ul><li>Familias beneficiarias del <a href=\"https://www.chvnoticias.cl/te-ayuda/subsidio-unico-familiar-aumento-monto-salario-minimo_20220525/\">Subsidio nico Familiar</a> (SUF) y de la <a href=\"https://www.chvnoticias.cl/te-ayuda/nuevo-monto-asignacion-familiar-salario-minimo_20220526/\">Asignacin Familiar o Maternal</a>, siempre que reciban dichos beneficios por tener ingresos iguales o inferiores al lmite mximo establecido en la Ley N 18.987 (que, actualmente, es de $907.672).</li><li>Familias que al 31 de diciembre de 2021 fueran usuarias del subsistema <a href=\"http://www.chileseguridadesyoportunidades.gob.cl/que-es\">Seguridades y Oportunidades</a>, independientemente de si reciben dinero por esta causa.</li><li>Familias que al 31 de diciembre de 2021 estuvieran participando en el subsistema <a href=\"https://www.ips.gob.cl/servlet/internet/content/1421810829144/chile-solidario#:~:text=El%20sistema%20Chile%20Solidario%20promueve,para%20que%20superen%20la%20indigencia.\">Chile Solidario.</a></li></ul><p><br data-cke-filler=\"true\"></p><p>Como ya mencionamos, el <strong>monto del beneficio se ajusta mes a mes en base a la inflacin.</strong> Mientras durante el primer mes se pagaron<strong> $7.342 por carga familiar</strong>, el aporte aument para agosto.</p><p>Durante este mes, sin embargo, <strong>se pagar $8.258</strong>, correspondiente a julio.</p><p><br data-cke-filler=\"true\"></p><p>En septiembre, en tanto, segn comunicaron desde el <a href=\"https://www.ips.gob.cl/\">IPS</a>, el Aporte Canasta Bsica a pagar ser de<strong> $8.575 por causante</strong>, lo que representa un <strong>alza de $317 con respecto al anterior.</strong></p><p><br data-cke-filler=\"true\"></p><p><br data-cke-filler=\"true\"></p><h2><strong>Cmo saber si me corresponde?</strong></h2><p>La consulta para saber si una persona es beneficiaria del Aporte Canasta Bsica est disponible de forma online en el sitio web <a href=\"https://www.aportecanasta.cl/\">www.aportecanasta.cl.</a></p><p style=\"margin-left:0px;\"><a href=\"https://www.aportecanasta.cl/\"><span class=\"image-inline ck-widget image_resized ck-widget_with-resizer\" style=\"width:auto;\" contenteditable=\"false\"><img src=\"https://media.chvnoticias.cl/2022/08/ips-1024x408-1.jpg\" alt=\"\" srcset=\"//media.chvnoticias.cl/2022/08/ips-1024x408-1.jpg 1024w, //media.chvnoticias.cl/2022/08/ips-1024x408-1-532x212.jpg 532w, //media.chvnoticias.cl/2022/08/ips-1024x408-1-768x306.jpg 768w\" sizes=\"100vw\" width=\"876\"><div class=\"ck ck-reset_all ck-widget__resizer\" style=\"height: 349px; left: 0px; top: 0px; width: 876px; display: none;\"><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-left\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-left\"></div><div class=\"ck ck-size-view\" style=\"display: none;\"></div></div></span></a></p><p style=\"margin-left:0px;\">IPS-ChileAtiende</p><p>Para hacer la consulta solo deben ingresar su <strong>RUT y su fecha de nacimiento.</strong></p><p>En esa pgina web las personas pueden, adems,<strong> conocer su fecha y lugar de pago del beneficio.</strong></p><p style=\"margin-left:0px;\"><a href=\"https://consulta.aportecanasta.cl/Canasta-Consulta/\"><span class=\"image-inline ck-widget image_resized ck-widget_with-resizer\" style=\"width:auto;\" contenteditable=\"false\"><img src=\"https://media.chvnoticias.cl/2022/08/ips-1.jpg\" alt=\"\" srcset=\"//media.chvnoticias.cl/2022/08/ips-1.jpg 466w, //media.chvnoticias.cl/2022/08/ips-1-266x320.jpg 266w\" sizes=\"100vw\" width=\"466\"><div class=\"ck ck-reset_all ck-widget__resizer\" style=\"height: 560px; left: 0px; top: 0px; width: 466px; display: none;\"><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-left\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-left\"></div><div class=\"ck ck-size-view\" style=\"display: none;\"></div></div></span></a></p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26zf44l7r9u2jd.jpg',1,'2022-09-07 07:00:32','2022-09-07 07:00:32',19,15),(28,'Sexto retiro: En qu est el nuevo proyecto de extraccin de fondos previsionales?','sexto-retiro:-en-que-esta-el-nuevo-proyecto-d','La iniciativa debe ser discutida por las dos Cmaras del Congreso, que le deben dar luz verde para que se convierta en Ley de la Repblica.','<p>Tras el&nbsp;<a href=\"https://www.chvnoticias.cl/economia/proyectos-quinto-retiro-rechazados-camara_20220418/\">rechazo del quinto retiro en el Congreso en abril pasado</a>, la diputada Pamela Jiles (PH) ha reiterado su intencin de discutir el proyecto que present: Un&nbsp;<strong>sexto retiro de fondos previsionales.</strong></p><p>Recordemos que&nbsp;la normativa del Congreso <strong>no permite ingresar un texto de similares caractersticas en el plazo de un ao</strong>. Sin embargo, algunos parlamentarios ya haban presentado cinco iniciativas nuevas con anterioridad, por lo que la discusin est ahora sobre si <strong>existir o no la posibilidad de tramitar un sexto retiro de las AFP.</strong></p><p>Esa es precisamente la duda que persiste actualmente, ya que la <strong>diputada Jiles ha instado en diversas ocasiones a poner el proyecto en tabla.</strong></p><p><a href=\"https://adclick.g.doubleclick.net/pcs/click%253Fxai%253DAKAOjsuWNHabyH-CEqBfmlXd2SRe997CupfoF2IayFxfpXHL8gwiwEanqMz_HosF2p8ORjzsSjkurIYoXVwtMmI6zpZFxGiXMCCri73bfTPUqZcEe1u6fBp25wI4wFxzD060QzsiuHTVylzv2Q9sSxojfJTw_OgNfkmMGKcFUGsZxm9LKDxQb1UTDmDRoHv5Wj86Rqov-ywAITusNBV55RuXcnkPYzeU1KV2NK-Oz6x0lSdKfUuXU_FyOutj_RtTYqYy1La15FmOCLoTTTqJVOsS0vgYy7SiTjuleBPOQjBCdmbe3pXL91hrA9AZln5uqFvWFPaj2dUaebK3xfJ_kQ%2526sai%253DAMfl-YQIJLK7dTPhq2LLQ6a4o0_HhUBvI0iMWAkLxACzQUxmwmShjuigoFaGZgNf-AaqaRZU8H2aD_IGXv4iTqeaLrOQQhFPHwC_oVZUxekivGRDXpWPfSik2OXjz1XkDMWPvKohJUMe%2526sig%253DCg0ArKJSzE_OCpFOGveKEAE%2526fbs_aeid%253D%255Bgw_fbsaeid%255D%2526urlfix%253D1%2526adurl%253Dhttps://www9.smartadserver.com/click?imgid=28711834&amp;insid=11117728&amp;pgid=1171966&amp;fmtid=66094&amp;ckid=681755324767213498&amp;uii=4350996394685694106&amp;acd=1662535318392&amp;opid=6cc608cf-ae22-4748-8fe7-63cb7686987a&amp;opdt=1662535318391&amp;tmstp=7942587389&amp;tgt=%24dt%3d1t%3b%24hc&amp;systgt=%24qc%3d1314973209%3b%24ql%3dLow%3b%24qt%3d11_545_33368t%3b%24dma%3d0%3b%24b%3d17999%3b%24o%3d11100%3b%24sw%3d1280%3b%24sh%3d768&amp;envtype=0&amp;imptype=0&amp;gdpr=0&amp;pgDomain=https%3a%2f%2fwww.chvnoticias.cl%2feconomia%2fsexto-retiro-en-que-esta-congreso_20220810%2f&amp;cappid=681755324767213498&amp;go=https%3a%2f%2fwww.previsionsocial.gob.cl%2fsps%2f%3futm_source%3dmediastream%26utm_medium%3dpaid_cpm%26utm_campaign%3dpermiso_postnatal_parental_%26utm_content%3dalcance_31-08-22_cubo_intereses_septiembre_2022\"><span class=\"image-inline ck-widget ck-widget_with-resizer\" contenteditable=\"false\"><img src=\"https://creatives.sascdn.com/diff/3101/11117728/left_9273bb83-97c7-4827-9bc4-2adbff554852.jpg\" alt=\"\"><div class=\"ck ck-reset_all ck-widget__resizer\" style=\"height: 250px; left: 0px; top: 0px; width: 300px; display: none;\"><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-left\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-left\"></div><div class=\"ck ck-size-view\" style=\"display: none;\"></div></div></span></a></p><p>La ltima vez que lo hizo fue este martes, cuando protagoniz un<a href=\"https://www.chvnoticias.cl/nacional/karol-cariola-pamela-jiles-discusion-sexto-retiro_20220810/\"> tenso momento con su par Karol Cariola</a> (PC) en la Comisin de Constitucin de la Cmara de Diputadas y Diputados.</p><p>En la instancia, la parlamentaria del Partido Humanista pidi la palabra para pedir que la iniciativa de <strong>sexto retiro se ponga en tabla con la mayor urgencia posible.</strong></p><p>El proyecto fue <strong>declarado admisible por la mesa de esta Cmara</strong> y luego entonces se pasa a la Comisin correspondiente. En el caso del sexto retiro, fue <strong>transferido, su tramitacin, a esta Comisin</strong> y luego lo que corresponde es que la presidenta lo ponga o no lo ponga en tabla, argument.</p><p><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><span class=\"image-inline ck-widget image_resized ck-widget_with-resizer\" style=\"width:auto;\" contenteditable=\"false\"><img src=\"https://media.chvnoticias.cl/2021/07/afp.jpg\" alt=\"\" srcset=\"//media.chvnoticias.cl/2021/07/afp.jpg 4268w, //media.chvnoticias.cl/2021/07/afp-515x320.jpg 515w, //media.chvnoticias.cl/2021/07/afp-768x477.jpg 768w, //media.chvnoticias.cl/2021/07/afp-1024x636.jpg 1024w\" sizes=\"100vw\" width=\"693\"><div class=\"ck ck-reset_all ck-widget__resizer\" style=\"height: 430px; left: 0px; top: 0px; width: 693px; display: none;\"><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-left\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-left\"></div><div class=\"ck ck-size-view\" style=\"display: none;\"></div></div></span></p><p style=\"margin-left:0px;\">Agencia Uno</p><p>Sin embargo, Cariola presidenta de la Comisin, explic que&nbsp;el&nbsp;<strong>listado de propuestas a discutir no lo pone ella</strong>: <strong>No tiene que ver con una voluntad personal, individual</strong> ni mucho menos algo que exceda mis competencias.</p>','https://chaimanoticias.s3.amazonaws.com/6dn26zd24l7rame96.jpg',1,'2022-09-07 07:22:33','2022-09-07 07:22:33',19,15),(29,'Santiago es elegida como una de las 6 ciudades a nivel mundial donde se vive bien con 1000 dlares al mes','santiago-es-elegida-como-una-de-las-6-ciudade','El medio estadounidense Business Insider seleccion a la capital de nuestro pas como una de los mejores lugares para vivir cmodamente con esa cantidad de dinero. El criterio, eso s, considera los costos de vida mensuales estimados para una sola persona','<p>Un artculo elaborado por el <a href=\"https://www.businessinsider.com/6-cities-you-can-live-1000-or-less-per-month-2022-8\">medio estadounidense <strong>Business Insider</strong></a> catalog a<strong> Santiago como una de las 6 ciudades del mundo donde se vive bien con US$1000 dlares al mes.&nbsp;</strong></p><p>Segn la publicacin, por la cifra equivalente a $881 mil pesos chilenos, se puede acceder en la capital a <strong>un ambiente cosmopolita, diversos panoramas, gran actividad cultural y a dos de las tres mejores universidades de Amrica Latina.&nbsp;</strong></p><p><br data-cke-filler=\"true\"></p><p>Para esta seleccin, el medio utiliz datos del sitio web Numbeo, que <strong>proporciona informacin sobre el costo de vida</strong> en las principales ciudades del mundo. Sin embargo, el criterio solo considera los costos de vida mensuales estimados para una sola persona<strong> en un departamento arrendado de una habitacin</strong>.</p><p><br data-cke-filler=\"true\"></p><p>La medicin tambin contempl factores como el poder adquisitivo, la contaminacin, la atencin mdica, la seguridad y los tiempos de viaje en el trfico.</p><p>A medida que la crisis del costo de vida se extiende por todo el mundo,&nbsp;<strong>muchas personas pueden considerar mudarse a partes ms baratas del mundo</strong>, fue una de las premisas del artculo, que tambin aborda la situacin econmica a nivel global y los altos niveles de inflacin.</p><h2><strong>Las otras ciudades del ranking</strong></h2><p>Dentro de los aspectos ms interesantes del listado, <strong>destaca Latinoamrica con la presencia de varias ciudades del continente</strong>.</p><p><br data-cke-filler=\"true\"></p><p>La capital de Argentina, <strong>Buenos Aires</strong>, ocup un puesto gracias a<strong> una comida increble, una animada vida nocturna y un sinfn de delicias culturales</strong>.</p><p><br data-cke-filler=\"true\"></p><p>La ciudad mexicana de <strong>Monterrey</strong>, en tanto, tambin ingres al artculo debido a que <strong>ha ganado la reputacin de ser la ciudad ms progresista del norte de Mxico, y es tambin un importante centro industrial</strong>, sostuvo Business Insider.</p><p>El resto de la seleccin incluye a&nbsp;<strong>Ciudad del Cabo</strong> en Sudfrica, la ciudad blgara de <strong>Sofa</strong> y <strong>Bursa</strong> en Turqua.</p><p><br><br data-cke-filler=\"true\"></p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26zd24l7raokwd.jpg',1,'2022-09-07 07:24:14','2022-09-07 07:24:14',19,15),(30,'Sufre todo Marsella: Por qu Alexis no podr jugar en el inicio de la Champions League?','sufre-todo-marsella:-por-que-alexis-no-podra-','El tocopillano est viviendo un esplndido momento futbolstico, pero se perder el primer duelo de su equipo en el certamen por una inslita situacin ocurrida hace algunos meses, cuando ni siquiera estaba en el club.','<p>Un gran momento futbolstico es el que est viviendo el delantero nacional <a href=\"https://www.chvnoticias.cl/tag/alexis/\">Alexis Snchez</a>, quien el pasado sbado viene de convertir su tercer gol en el <a href=\"https://www.chvnoticias.cl/tag/marsella/\">Olympique de Marsella</a> en la victoria 2-0 ante el Auxerre por la Ligue 1.</p><p>El tocopillano ha encontrado la titularidad que tantas veces busc en Europa y aspira a tener una gran temporada con su club, con el cual<strong> disputar la fase de grupos</strong> de la <a href=\"https://www.chvnoticias.cl/tag/champions-league/\">Champions League</a>.</p><p>Sin embargo, lamentablemente el formado en Cobreloa no podr estar en el estreno del torneo ms importante a nivel de clubes de Europa por <strong>una situacin que se dio hace varios meses atrs</strong>, cuando todava estaba en el Inter.</p><p><br data-cke-filler=\"true\"></p><p>Todo se remonta al 8 de marzo pasado, cuando el goleador de <a href=\"https://www.chvnoticias.cl/tag/la-roja/\">La Roja</a> fue expulsado en el<strong> triunfo 1-0 de los neroazzurros ante el Liverpool</strong> por los octavos de final de vuelta del certamen, encuentro en el que fue expulsado a los 63 minutos.</p><p>En aquel duelo, Alexis comenz como titular haciendo dupla con Lautaro Martnez, pero termin yndose a las duchas a los 63 minutos tras una fuerte falta sobre Fabinho. Desde entonces, prcticamente <strong>desapareci del mapa del tcnico Simone Inzaghi.</strong></p><p>Ahora, Maravilla deber mirar desde su casa el choque que afrontarn <strong>sus compaeros ante el Tottenham en Inglaterra</strong>, duelo que est pactado para este mircoles 7 de septiembre a las 15:00 horas de Chile.</p>','https://chaimanoticias.s3.amazonaws.com/6dn26z96gl7rvpmri.jpg',1,'2022-09-07 17:12:55','2022-09-07 17:12:55',19,8),(31,'Con sudamericanos incluidos: Los 3 fichajes que remecieron el cierre del mercado de pases en Europa','con-sudamericanos-incluidos:-los-3-fichajes-q','A excepcin de Portugal, todas las ligas fuertes del viejo continente finalizaron este jueves el periodo reglamentario para contratar jugadores. Una de las grandes sorpresas fue la llegada de un volante brasileo al poderoso Liverpool.','<p>Como es tradicional en cada temporada, este 1 de septiembre hubo una <strong>frentica jornada en Europa</strong>. Esto porque es el ltimo da en que<strong> los equipos pueden fichar jugadores.</strong></p><p>La jornada arranc muy movida para varias instituciones, debido a que tienen que cumplir con la reglamentacin necesaria en caso de que<strong> necesiten adquirir o vender a algn futbolista.</strong></p><p>Ante esto, en <a href=\"https://www.chvnoticias.cl/\"><i>CHV Noticias</i></a> recopilamos las transferencias ms importantes del cierre del libro de pases eurpeo, las que incluyeron a <strong>clubes que se arman con todo</strong> para pelear sus respectivas ligas y la <a href=\"https://www.chvnoticias.cl/tag/champions-league/\">Champions League.</a></p><p><br data-cke-filler=\"true\"></p><h2><strong>Liverpool suma talento brasileo</strong></h2><p>Uno de los movimientos ms llamativos fue el del volante brasileo <strong>Arthur Melo</strong>, quien se suma nada menos que al <strong>Liverpool de Jrgen Klopp</strong> en un sorpresivo traspaso.</p><p>El formado en Gremio, que fue pieza<strong> clave en la obtencin de la Copa Libertadores 2017</strong>, tuvo un buen arranque en el Barcelona, pero poco a poco su rendimiento se fue diluyendo y en la Juventus jug poco y nada.</p><p>Con esto, el mediocampista de 26 aos aspira a ganarse un puesto en uno de los equipos ms competitivos de la <a href=\"https://www.chvnoticias.cl/tag/premier-league/\">Premier League</a> y a ser <strong>considerado por Tite en la seleccin brasilea</strong>, justo cuando comienzan a definirse las nminas para el Mundial de Qatar.</p><p><br data-cke-filler=\"true\"></p><p><br data-cke-filler=\"true\"></p><h2><strong>La Juventus, cada vez ms argentina</strong></h2><p>En el mercado italiano, la <strong>Juventus</strong> fue uno de los tantos conjuntos que se movi para potenciarse y volver a recuperar el sitial de <strong>equipo ms fuerte de la Serie A.</strong></p><p>Para esto, la dirigencia intent desde hace varios meses contratar al volante argentino <strong>Leandro Paredes, quien perdi terreno en el PSG</strong> y buscaba desesperadamente salir para tener ms minutos de cara al Mundial.</p><p>Sin embargo, la negociacin no fue para nada sencilla y recin se pudo arreglar esta semana para el formado en <strong>Boca Juniors que debut de la mano de Claudio Borghi con 16 aos.</strong></p><p>Ahora, ser compaero de un viejo conocido de la albiceleste. Se trata nada menos que de <strong>ngel Di Mara</strong>, a quien conoce de su paso por el ftbol francs.</p><p><br data-cke-filler=\"true\"></p><h2><strong>Aubameyang vuelve a la Premier</strong></h2><p>En tanto, una de las transferencias ms llamativas fue la del atacante&nbsp;<strong>Pierre-Emerick Aubameyang</strong>, que fue vendido del<strong> Barcelona al Chelsea</strong> de manera bastante sorpresiva.</p><p>Esto porque el gabons lleg a principios del 2022 a los catalanes y rpidamente se gan un puesto de titular en el elenco de Xavi, siendo importante e incluso<strong> marcndole un doblete al Real Madrid</strong> en marzo pasado.</p><p>Pero la llegada de <strong>Robert Lewandowski</strong> y la necesidad de vender a un jugador para no tener problemas con el fair play financiero obligaron a la <strong>dirigencia catalana a poner al africano en el mercado.</strong></p><p>De esta forma,&nbsp;<strong>Aubameyang retorna a la Premier League</strong> luego de un interesante paso por el Arsenal, siendo oficializado por el elenco azul de Londres este mismo jueves.</p><p><br data-cke-filler=\"true\"></p><p><br data-cke-filler=\"true\"></p><p>Otros de los <strong>movimientos importantes</strong> fueron:</p><ul><li>Justin Kluivert: De la Roma al Valencia</li><li>Hctor Bellern: Del Real Betis al Barcelona</li><li>Sergio Dest: Del Barcelona al Milan</li><li>Willian: Del Corinthians al Fulham</li><li>Manuel Akanji: Del Borussia Dortmund al Manchester City</li><li>Julian Draxler: Del PSG al Benfica</li><li>Carlos Soler: Del Valencia al PSG</li></ul><p>Por el lado de los chilenos, el nico que tena opciones concretas de cambiar de rumbo era <a href=\"https://www.chvnoticias.cl/tag/ben-brereton/\">Ben Brereton</a>, pero el <a href=\"https://www.chvnoticias.cl/tag/blackburn-rovers/\">Blakburn Rovers</a> rechaz al menos dos ofertas de la Premier y el delantero de <a href=\"https://www.chvnoticias.cl/tag/la-roja/\">La Roja</a> continuar un <strong>tiempo ms en la Championship.</strong></p><p>Cabe consignar que la nica liga europea que sigue permitiendo a sus clubes<strong> contratar futbolistas es Portugal</strong>, quienes pueden negociar hasta el prximo 22 de septiembre.</p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26z96gl7rvrz7k.png',1,'2022-09-07 17:14:44','2022-09-07 17:14:44',19,8),(32,'Existen noticias falsas circulando: La aclaracin de Pel tras ola de rumores sobre su estado de salud','\"existen-noticias-falsas-circulando\":-la-acla','El ex futbolista brasileo, quien se encuentra en tratamiento por un tumor en el colon, sali al paso de informaciones acerca de un supuesto agravamiento de su salud. \"Esto me decepciona, pero no me afectar\", expres.','<p>(<i>EFE</i>)  El ex futbolista brasileo Edson Arantes do Nascimento, ms conocido como <strong>Pel</strong>, sali a desmentir este lunes los rumores acerca de un<strong> supuesto agravamiento de su estado de salud y asegur que est muy bien.</strong></p><p>Tuve que publicar esto porque existen noticias falsas circulando sobre este asunto.<strong> Esto me decepciona, pero no me afectar. Estoy ganando este partido</strong>, afirm el triple campen del mundo de 81 aos, en un mensaje publicado en sus redes sociales.</p><p>El ex delantero del Santos y Cosmos acompa sus palabras con una fotografa en la que aparece sonriente al lado de su esposa,<strong> Mrcia Aoki</strong>.</p><p><br data-cke-filler=\"true\"></p><p>Estoy muy agradecido por mi esposa, por las risas, por la paz de mi hogar y por todos los mensajes cariosos de ustedes. <strong>Estoy muy bien y cuidando mi salud</strong>, garantiz.</p><p>Esta no es la primera vez que Pel, considerado por muchos el mejor jugador de la historia del ftbol, recurre a las redes sociales para <strong>desmentir rumores sobre su delicado estado de salud.</strong></p><p>Cabe recordar que se oper hace casi un ao de un <strong>tumor en el colon detectado durante una batera rutinaria de exmenes</strong>. A partir de ah, inici un ciclo de sesiones de quimioterapia que le ha obligado a pasar por el hospital algunas veces para seguir de cerca su evolucin.</p><p><br data-cke-filler=\"true\"></p><p><strong>Desde entonces, su estado de salud ha estado rodeado de cierto misterio</strong>, pues son pocas las informaciones que salen desde su entorno, aunque de acuerdo con los boletines de salud de meses anteriores su cuadro se mantiene estable.</p><p>La salud de Pel se ha deteriorado en los ltimos aos tambin por otras causas, como <strong>problemas en la columna, la cadera y la rodilla</strong>, que han reducido su movilidad y le han obligado a pasar por el quirfano, adems de<strong> sufrir alguna crisis renal. </strong>Esto&nbsp;<strong>ha reducido de forma drstica sus apariciones pblicas</strong>, aunque se mantiene muy activo en redes sociales.</p><h2><strong>Revisa la publicacin de Pel ac:</strong></h2><p><span style=\"background-color:rgb(255,255,255);color:rgb(38,38,38);\"><code>&lt;blockquote class=\"instagram-media\" data-instgrm-captioned data-instgrm-permalink=\"https://www.instagram.com/p/Ch2u5gPOvxx/?utm_source=ig_embed&amp;amp;utm_campaign=loading\" data-instgrm-version=\"14\" style=\" background:#FFF; border:0; border-radius:3px; box-shadow:0 0 1px 0 rgba(0,0,0,0.5),0 1px 10px 0 rgba(0,0,0,0.15); margin: 1px; max-width:540px; min-width:326px; padding:0; width:99.375%; width:-webkit-calc(100% - 2px); width:calc(100% - 2px);\"&gt;&lt;div style=\"padding:16px;\"&gt; &lt;a href=\"https://www.instagram.com/p/Ch2u5gPOvxx/?utm_source=ig_embed&amp;amp;utm_campaign=loading\" style=\" background:#FFFFFF; line-height:0; padding:0 0; text-align:center; text-decoration:none; width:100%;\" target=\"_blank\"&gt; &lt;div style=\" display: flex; flex-direction: row; align-items: center;\"&gt; &lt;div style=\"background-color: #F4F4F4; border-radius: 50%; flex-grow: 0; height: 40px; margin-right: 14px; width: 40px;\"&gt;&lt;/div&gt; &lt;div style=\"display: flex; flex-direction: column; flex-grow: 1; justify-content: center;\"&gt; &lt;div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; margin-bottom: 6px; width: 100px;\"&gt;&lt;/div&gt; &lt;div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; width: 60px;\"&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div style=\"padding: 19% 0;\"&gt;&lt;/div&gt; &lt;div style=\"display:block; height:50px; margin:0 auto 12px; width:50px;\"&gt;&lt;svg width=\"50px\" height=\"50px\" viewBox=\"0 0 60 60\" version=\"1.1\" xmlns=\"https://www.w3.org/2000/svg\" xmlns:xlink=\"https://www.w3.or