ow: 0; height: 20px; width: 20px;\"&gt;&lt;/div&gt; &lt;div style=\" width: 0; height: 0; border-top: 2px solid transparent; border-left: 6px solid #f4f4f4; border-bottom: 2px solid transparent; transform: translateX(16px) translateY(-4px) rotate(30deg)\"&gt;&lt;/div&gt;&lt;/div&gt;&lt;div style=\"margin-left: auto;\"&gt; &lt;div style=\" width: 0px; border-top: 8px solid #F4F4F4; border-right: 8px solid transparent; transform: translateY(16px);\"&gt;&lt;/div&gt; &lt;div style=\" background-color: #F4F4F4; flex-grow: 0; height: 12px; width: 16px; transform: translateY(-4px);\"&gt;&lt;/div&gt; &lt;div style=\" width: 0; height: 0; border-top: 8px solid #F4F4F4; border-left: 8px solid transparent; transform: translateY(-4px) translateX(8px);\"&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt; &lt;div style=\"display: flex; flex-direction: column; flex-grow: 1; justify-content: center; margin-bottom: 24px;\"&gt; &lt;div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; margin-bottom: 6px; width: 224px;\"&gt;&lt;/div&gt; &lt;div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; width: 144px;\"&gt;&lt;/div&gt;&lt;/div&gt;&lt;/a&gt;&lt;p style=\" color:#c9c8cd; font-family:Arial,sans-serif; font-size:14px; line-height:17px; margin-bottom:0; margin-top:8px; overflow:hidden; padding:8px 0 7px; text-align:center; text-overflow:ellipsis; white-space:nowrap;\"&gt;&lt;a href=\"https://www.instagram.com/p/Ch2u5gPOvxx/?utm_source=ig_embed&amp;amp;utm_campaign=loading\" style=\" color:#c9c8cd; font-family:Arial,sans-serif; font-size:14px; font-style:normal; font-weight:normal; line-height:17px; text-decoration:none;\" target=\"_blank\"&gt;Una publicacin compartida por Pele (@pele)&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;/blockquote&gt; &lt;script async src=\"//www.instagram.com/embed.js\"&gt;&lt;/script&gt;</code></span></p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26z96gl7rvuttp.jpg',1,'2022-09-07 17:16:56','2022-09-07 17:16:56',19,8),(33,'Claudio Borghi aplaude doblete de Alexis en Francia: No debera sorprendernos nada de lo que haga','claudio-borghi-aplaude-doblete-de-alexis-en-f','El ex entrenador de la seleccin chilena llen de elogios el rendimiento del tocopillano en el ftbol francs. \"Est acostumbrado a grandes eventos y esto le hace muy bien a l y a la seleccin\", dijo a CHV Noticias.','<p>Un renacer futbolstico es el que est viviendo <a href=\"https://www.chvnoticias.cl/tag/alexis/\">Alexis Snchez</a> en <a href=\"https://www.chvnoticias.cl/tag/francia/\">Francia</a>, luego de que este domingo anotara un doblete en la victoria 3-0 del <a href=\"https://www.chvnoticias.cl/tag/marsella/\">Marsella</a> ante el Niza por<strong> la cuarta fecha de la Ligue 1.</strong></p><p>Si bien el tocopillano ya haba mostrado parte de su calidad en sus dos anteriores presentaciones, ahora lleg el momento en que <strong>lo refrendara en el arco rival</strong>, lo que hizo convirtiendo dos tantos.</p><p>Las anotaciones del atacante de 33 aos fueron valoradas por su ex entrenador en <a href=\"https://www.chvnoticias.cl/tag/colo-colo/\">Colo Colo</a> y en la seleccin chilena, <a href=\"https://www.chvnoticias.cl/tag/claudio-borghi/\">Claudio Borghi</a>, quien abord <strong>sus primeros encuentros con su nuevo club.</strong></p><p><br data-cke-filler=\"true\"></p><p>En conversacin con <a href=\"https://www.chvnoticias.cl/\"><i>CHVNoticias.cl</i></a>, el Bichi afirm que Alexis es un jugador internacional de buen nivel, <strong>no debera sorprendernos nada de lo que haga</strong>.</p><p><br data-cke-filler=\"true\"></p><p>De igual modo, el actual comentarista asegur que se debe valorar el rendimiento que consigui Snchez en pocos das, debido a que llega a un pas en el que, primero, nunca ha jugado. Segundo, hay un problema de idioma y comunicacin, pero ya est acostumbrado a grandes eventos y <strong>esto le hace muy bien a l y a la seleccin.</strong></p><p>Es un jugador que, a pesar de la edad y el tiempo, <strong>no ha bajado su nivel y creo que es muy bueno</strong>, agreg.</p><p><br data-cke-filler=\"true\"></p><p>Adems, Borghi seal que el Marsella tiene buenas chances de avanzar de ronda en la <a href=\"https://www.chvnoticias.cl/tag/champions-league/\">Champions League</a>, donde compartir grupo con el <strong>Tottenham de Inglaterra, Sporting de Lisboa, de Portugal, y el Eintracht Frankfurt</strong> de Alemania.</p><p>Claramente puede pasar (a octavos de final). De los equipos franceses, el Marsella es el que ms historia tiene. El <a href=\"https://www.chvnoticias.cl/tag/psg/\">PSG</a>, por una cuestin econmica, ha contratado muchos jugadores, pero histricamente (el Olympique) es el equipo que<strong> ha representado a Francia de la mejor manera</strong>. Ojal que le vaya muy bien, aadi.</p><p><br data-cke-filler=\"true\"></p><p><span style=\"background-color:rgb(255,255,255);color:rgb(136,153,166);\"><code class=\"ck-code_selected\">&lt;blockquote class=\"twitter-tweet\"&gt;&lt;p lang=\"ca\" dir=\"ltr\"&gt;La historieta de moda en Marsella ? &lt;a href=\"https://t.co/QogiAFB6Tp\"&gt;pic.twitter.com/QogiAFB6Tp&lt;/a&gt;&lt;/p&gt;&amp;mdash; Olympique de Marseille ???????? (@OM_Espanol) &lt;a href=\"https://twitter.com/OM_Espanol/status/1564019426206392320?ref_src=twsrc%5Etfw\"&gt;August 28, 2022&lt;/a&gt;&lt;/blockquote&gt; &lt;script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"&gt;&lt;/script&gt;</code></span></p><h2><strong>Citado en septiembre?</strong></h2><p>El otrora futbolista de Audax Italiano y River Plate, entre otros, opin sobre si el delantero debe ser nominado por <a href=\"https://www.chvnoticias.cl/tag/berizzo/\">Eduardo Berizzo</a> a los amistosos que Chile tiene programados a <strong>fines de septiembre ante Marruecos y Qatar</strong>, dos selecciones mundialistas.</p><p><strong>Sera ideal que lo pueda llamar,</strong> sostuvo el campen del Mundo en 1986, recalcando que tambin hay cosas contractuales. No se puede presentar una seleccin nacional sin muchos jugadores de renombre, hay contratos que respetar. Si no es l, debera (perderse un jugador) de la defensa.</p><p><strong>s de la patria ante los africanos,</strong> el cual se jugar a las 16:00 horas en el Estadio del Espanyol de Barcelona. mientras que cuatro das ms tarde se medir contra los qatares<strong> a las 14:00 horas en Austria.</strong></p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26z96gl7rvzsxl.png',1,'2022-09-07 17:20:49','2022-09-07 17:20:49',19,8),(34,'Salen sus sopaipas: Las graciosas respuestas de Ben Brereton al cuestionario de Tiane Endler','\"salen-sus-sopaipas\":-las-graciosas-respuesta','El ariete se luci ante las preguntas de la portera, en las que sac a flote todo su conocimiento sobre los dichos y hbitos chilenos. \"Si nos cortan el himno...\", pregunt la capitana. Qu habr contestado el delantero?','<p><strong>Dos de las figuras ms queridas</strong> de las selecciones de ftbol chilenas se unieron para protagonizar un gracioso <strong>cuestionario sobre las costumbres y dichos nacionales</strong>.</p><p>Se trata de <strong>Christiane Endler</strong> y <strong>Benjamin Brereton</strong>, quienes realizaron un simptico pimponeo de preguntas y respuestas en las que la <strong>arquera puso a prueba al delantero</strong>.</p><p><br data-cke-filler=\"true\"></p><p><strong>Si llueve?</strong>, pregunt Tiane, y Ben respondi <strong>salen sus sopaipas</strong>, en el marco de una campaa de la marca Adidas.</p><p><strong>&nbsp;Si falta uno?</strong>, interrog la portera del Olympique Lyon al <a href=\"https://www.chvnoticias.cl/deportes/propuesta-dt-ben-brereton-desayuno-cafe_20220725/\">ariete del Blackburn Rovers</a>, quien contest <strong>voy de galleta</strong>.</p><p><strong>Endler:</strong> Si te provocan en un partido</p><p><strong>Brereton:</strong> Tranquilo, bro</p><p><br data-cke-filler=\"true\"></p><p><strong>E:</strong> Despus de entrenar</p><p><strong>B:</strong> Su mote con huesillo</p><p><strong>E:</strong> Si juega Chile</p><p><strong>B:</strong> Me pongo La Roja</p><p><strong>E:</strong> Si te hacen una pregunta con cizaa</p><p><strong>B:</strong> La tiro al crner</p><p><strong>E:</strong> Si nos cortan el himno</p><p><strong>B:</strong> Seguimos cantando</p><p><strong>E:</strong> Si nos toca un rival difcil</p><p><strong>B:</strong>&nbsp;Y que tanto</p><p><strong>E:</strong> y cuando se juega</p><p><strong>B:</strong> Se moja</p><h2><strong>Revisa el video completo ac:</strong></h2><p><span style=\"background-color:rgb(255,255,255);color:rgb(38,38,38);\"><code class=\"ck-code_selected\">&lt;blockquote class=\"instagram-media\" data-instgrm-captioned data-instgrm-permalink=\"https://www.instagram.com/reel/CgfRdoOjzc5/?utm_source=ig_embed&amp;amp;utm_campaign=loading\" data-instgrm-version=\"14\" style=\" background:#FFF; border:0; border-radius:3px; box-shadow:0 0 1px 0 rgba(0,0,0,0.5),0 1px 10px 0 rgba(0,0,0,0.15); margin: 1px; max-width:540px; min-width:326px; padding:0; width:99.375%; width:-webkit-calc(100% - 2px); width:calc(100% - 2px);\"&gt;&lt;div style=\"padding:16px;\"&gt; &lt;a href=\"https://www.instagram.com/reel/CgfRdoOjzc5/?utm_source=ig_embed&amp;amp;utm_campaign=loading\" style=\" background:#FFFFFF; line-height:0; padding:0 0; text-align:center; text-decoration:none; width:100%;\" target=\"_blank\"&gt; &lt;div style=\" display: flex; flex-direction: row; align-items: center;\"&gt; &lt;div style=\"background-color: #F4F4F4; border-radius: 50%; flex-grow: 0; height: 40px; margin-right: 14px; width: 40px;\"&gt;&lt;/div&gt; &lt;div style=\"display: flex; flex-direction: column; flex-grow: 1; justify-content: center;\"&gt; &lt;div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; margin-bottom: 6px; width: 100px;\"&gt;&lt;/div&gt; &lt;div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; width: 60px;\"&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div st