rtida por adidas Chile (@adidascl)&lt;/a&gt;&lt;/p&gt;&lt;/div&gt;&lt;/blockquote&gt; &lt;script async src=\"//www.instagram.com/embed.js\"&gt;&lt;/script&gt;</code></span><br><br data-cke-filler=\"true\"></p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26z96gl7rw3c5r.png',1,'2022-09-07 17:23:33','2022-09-07 17:23:33',19,8),(35,'Serena y Venus Williams volvern a jugar el dobles juntas: La ltima vez fue en 2018','serena-y-venus-williams-volveran-a-jugar-el-d','Las hermanas Williams recibieron una invitacin para participar del Open de Estados Unidos, el cual se realizar el prximo 11 de septiembre en Nueva York. Por su parte, Serena insinu que terminado el campeonato, anunciar su retiro del tenis profesional','<p>(<i>EFE</i>)  <strong>Las hermanas Serena y Venus Williams</strong> recibieron este sbado una carta de invitacin del Open de Estados Unidos para que participen juntas <strong>en el torneo de dobles, lo que marcar su regreso a las pistas como equipo por primera vez desde 2018.</strong></p><p>El encuentro deportivo se<strong> realizar el prximo 11 de septiembre en la ciudad de Nueva York.&nbsp;</strong></p><p>Fue el<strong> Roland Garros de 2018 la ltima vez en la que Serena y Venus compitieron juntas</strong> y en ese caso se pararan<strong> en la tercera ronda</strong>, al caer ante la espaola <strong>Mara Jos Martnez Snchez y la eslovena Andreja Klepac.</strong></p><p><br data-cke-filler=\"true\"></p><p><br data-cke-filler=\"true\"></p><p>Es importante destacar que<strong> Serena y Venus conquistaron juntas catorce grandes en dobles, incluidos los Open de Estados Unidos de 1999 y de 2009.</strong></p><p>Se espera con toda probabilidad de triunfar <strong>la ltima participacin de Serena en Nueva York</strong>, despus de que la veterana jugadora, de 40 aos, <strong>anunciara recientemente que est preparada para dejar el tenis sugiriendo que sera tras el campeonato.&nbsp;</strong></p><p><br data-cke-filler=\"true\"></p><h2><strong>La historia de las dos deportistas ms grandes de Estados Unidos</strong></h2><p>Serena Williams <strong>se convirti en tenista profesional a los 14 aos y desde entonces h</strong>a ganado 23 torneos de<strong> Grand Slam en individuales.</strong></p><p><br data-cke-filler=\"true\"></p><p>En <strong>2002 gan su primer Roland Garros al derrotar precisamente a su hermana Venus,</strong> y ese mismo ao conquist <strong>su primer Wimbledon.</strong></p><p><br data-cke-filler=\"true\"></p><p>Asimismo, Serena ha ganado en<strong> siete ocasiones el Abierto de Australia, otras siete veces Wimbledon, seis Abiertos de Estados Unidos y tres Roland Garros.&nbsp;</strong>Por su parte, Venus, de 42 aos, ha ganado siete grandes en individuales,<strong> con cinco Wimbledon y dos Open de Estados Unidos.</strong></p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26z96gl7rw6n96.png',1,'2022-09-07 17:26:09','2022-09-07 17:26:09',19,8),(36,'Concierto de Justin Bieber en Chile: Cmo ser la devolucin de entradas?','concierto-de-justin-bieber-en-chile:-como-ser','Este mircoles 7 de septiembre la fanaticada local de Justin Bieber esperaba con ansias asistir al concierto del artista canadiense en el Estadio Nacional, sin embargo, un da antes del show, la productora Lotus inform la cancelacin del evento.','<p style=\"margin-left:0px;\">Este mircoles 7 de septiembre la fanaticada local de <a href=\"https://www.meganoticias.cl/temas/justin-bieber/\"><strong>Justin Bieber</strong></a> esperaba con ansias asistir al concierto del artista canadiense en el Estadio Nacional, sin embargo, un da antes del show, la productora Lotus inform la cancelacin del evento.</p><p style=\"margin-left:0px;\">Previo a que se oficializara la suspensin del espectculo, medios brasileos ya haban&nbsp;sealado que el cantante cancelara su gira por Sudamrica debido a problemas de salud mental. Eso s, mantendra el show programado para el&nbsp;<strong>Rock in Rio</strong> en Brasil.</p><p style=\"margin-left:0px;\">PUBLICIDAD</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><h2 style=\"margin-left:0px;\"><strong>Qu dijo la productora?</strong></h2><p style=\"margin-left:0px;\">Los rumores se confirmaron y a travs de sus distintas redes sociales, Lotus anunci que&nbsp;\"por motivos personales del artista, se suspenden las dems fechas del tramo Latinoamericano del <strong>Justice World Tour</strong> de Justin Bieber, incluido su concierto en Chile agendado para el 7 de septiembre en el Estadio Nacional\".</p><p style=\"margin-left:0px;\"><span style=\"background-color:rgb(255,255,255);color:rgb(38,38,38);\"><code>&lt;blockquote class=\"instagram-media\" data-instgrm-captioned data-instgrm-permalink=\"https://www.instagram.com/p/CiK9UIUOdFV/?utm_source=ig_embed&amp;amp;utm_campaign=loading\" data-instgrm-version=\"14\" style=\" background:#FFF; border:0; border-radius:3px; box-shadow:0 0 1px 0 rgba(0,0,0,0.5),0 1px 10px 0 rgba(0,0,0,0.15); margin: 1px; max-width:540px; min-width:326px; padding:0; width:99.375%; width:-webkit-calc(100% - 2px); width:calc(100% - 2px);\"&gt;&lt;div style=\"padding:16px;\"&gt; &lt;a href=\"https://www.instagram.com/p/CiK9UIUOdFV/?utm_source=ig_embed&amp;amp;utm_campaign=loading\" style=\" background:#FFFFFF; line-height:0; padding:0 0; text-align:center; text-decoration:none; width:100%;\" target=\"_blank\"&gt; &lt;div style=\" display: flex; flex-direction: row; align-items: center;\"&gt; &lt;div style=\"background-color: #F4F4F4; border-radius: 50%; flex-grow: 0; height: 40px; margin-right: 14px; width: 40px;\"&gt;&lt;/div&gt; &lt;div style=\"display: flex; flex-direction: column; flex-grow: 1; justify-content: center;\"&gt; &lt;div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; margin-bottom: 6px; width: 100px;\"&gt;&lt;/div&gt; &lt;div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; width: 60px;\"&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div style=\"padding: 19% 0;\"&gt;&lt;/