De acuerdo a los medios europeos, el delantero espaol ya vive con la joven de 23 aos en el <a href=\"https://www.meganoticias.cl/tendencias/388477-pique-y-su-nueva-novia-clara-chia-apartamento-fds-1ab.html\"><strong>apartamento</strong></a> donde vivi los primeros aos de su relacin con la cantante, incluso ya la habra presentado a sus hijos Sasha y Milan, hasta hubo <a href=\"https://www.meganoticias.cl/tendencias/387707-novia-pique-embarazada-shakira-fds-1ab.html\"><strong>rumores de embarazo</strong></a> de Clara.</p><p style=\"margin-left:0px;\">Mientras tanto, la situacin para Shakira es un poco ms complicada. La intrprete de Pies descalzos enfrenta una <a href=\"https://www.meganoticias.cl/tendencias/343318-shakira-fraude-fiscal-1ab.html\"><strong>demanda por evasin de impuestos</strong></a> en Espaa, mientras trata de llegar a un acuerdo con su exmarido por la <a href=\"https://www.meganoticias.cl/tendencias/388743-shakira-y-pique-hijos-custodia-1ab.html\"><strong>custodia</strong></a>&nbsp;de sus hijos para evitar los tribunales.</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><h2 style=\"margin-left:0px;\"><strong>Las ltimas fotos de Gerard Piqu con su novia</strong></h2><p style=\"margin-left:0px;\">Gerard Piqu y su novia disfrutaron de un almuerzo en el exclusivo restaurante Sushi Bar 99&nbsp;en Barcelona. El sitio es visitado con frecuencia por la pareja, segn public el diario <a href=\"https://cronicaglobal.elespanol.com/cronica-directo/famosos/gerard-pique-calentar-banquillo-llevarse-su-novia-clara-chia-comer-sushi_713606_102.html\"><strong>Crnica Directo</strong></a>.&nbsp;Sin embargo, en esta ocasin, lo acompa su compaero de equipo, Jordi Alba, con su novia y otros amigos.</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:auto !important;\"><span style=\"background-color:rgb(255,255,255);color:rgb(136,153,166);\"><code>&lt;blockquote class=\"twitter-tweet\"&gt;&lt;p lang=\"es\" dir=\"ltr\"&gt;CURIOSIDADES ?/ El director de scouting del FCB y futuro secretario tcnico del club, Jordi Cruyff, qued para comer con el abogado Juan de Dios Crespo Prez en el restaurante japons 99 Sushi Bar. All coincidieron y se vieron con Piqu, que haba acudido por cuenta propia. &lt;a href=\"https://t.co/Gzo2mqNowo\"&gt;pic.twitter.com/Gzo2mqNowo&lt;/a&gt;&lt;/p&gt;&amp;mdash; BarcelonismoFC ? (@racsozerimar8) &lt;a href=\"https://twitter.com/racsozerimar8/status/1506643051212587015?ref_src=twsrc%5Etfw\"&gt;March 23, 2022&lt;/a&gt;&lt;/blockquote&gt; &lt;script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"&gt;&lt;/script&gt;</code></span></p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">De acuerdo a la informacin divulgada por el medio, Piqu se diriga a una zona reservada, para resguardo de su privacidad con una cortina, pero en el camino fue interceptado por un conocido que le saludo, mientras Cha permaneca a su lado.</p><p style=\"margin-left:0px;\">La joven estudiante de relaciones pblicas iba vestida con una polera amarilla, un pequeo bolso y el cabello suelto. Piqu se mostraba sonriente y relajado durante la comida, muestra de que durante estos meses la relacin se ha normalizado.</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p><span class=\"image-inline ck-widget ck-widget_with-resizer\" contenteditable=\"false\"><img src=\"https://images2-mega.cdn.mdstrm.com/meganoticias/2022/09/06/388883_2_6317a3900117c.jpeg\" alt=\"\"><div class=\"ck ck-reset_all ck-widget__resizer\" style=\"display: none;\"><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-left\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-left\"></div><div class=\"ck ck-size-view\" style=\"display: none;\"></div></div></span></p><p><br data-cke-filler=\"true\"></p><p><br data-cke-filler=\"true\"></p><p><span class=\"image-inline ck-widget ck-widget_with-resizer\" contenteditable=\"false\"><img src=\"https://images2-mega.cdn.mdstrm.com/meganoticias/2022/09/06/388883_3_6317a390d4086.jpeg\" alt=\"\"><div class=\"ck ck-reset_all ck-widget__resizer\" style=\"display: none;\"><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-left\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-left\"></div><div class=\"ck ck-size-view\" style=\"display: none;\"></div></div></span></p><p><br data-cke-filler=\"true\"></p><p><br data-cke-filler=\"true\"></p><p><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">Algunos paparazzis afirman que Clara y Piqu llevan ms de un ao de romance, a pesar de que fue hacepocas semanas sali a la luz pblica.</p>','https://chaimanoticias.s3.amazonaws.com/6dn26z498l7rx1igv.jpg',1,'2022-09-07 17:50:15','2022-09-07 17:50:15',19,10),(38,'\"A punta de ganas, amor y tesn\": La emocin de Princesa Alba tras anunciar que abrir shows de Coldplay en Chile','\"a-punta-de-ganas-amor-y-teson\":-la-emocion-d','Trinidad Riveros, ms conocida como Princesa Alba, ser una de las artistas invitadas como telonera de la serie de conciertos que la banda britnica Coldplay har en nuestro pas durante las prximas semanas.','<p style=\"margin-left:0px;\"><strong>Trinidad Riveros,</strong> ms conocida como <strong>Princesa Alba</strong>, ser una de las artistas invitadas como telonera de la serie de conciertos que la banda britnica <strong>Coldplay</strong> har en nuestro pas durante las prximas semanas.</p><p style=\"margin-left:0px;\">As fue anunciado por DG Medios, la productora detrs de la visita de la agrupacin a Chile, que comparti un video en sus redes sociales mostrando la reaccin de la cantante nacional.</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">\"Al fin lo puedo anunciar, voy a telonear a Coldplay en Chile, <strong>estoy muy contenta, para m significa muchsimo en cuanto a mi carrera,</strong> nada, es un logro gigante, estoy muy contenta\", seal Riveros.</p><p style=\"margin-left:0px;\"><span style=\"background-color:rgb(255,255,255);color:rgb(38,38,38);\"><code>&lt;blockquote class=\"instagram-media\" data-instgrm-captioned data-instgrm-permalink=\"https://www.instagram.com/reel/CiIuW9kpjF1/?utm_source=ig_embed&amp;amp;utm_campaign=loading\" data-instgrm-version=\"14\" style=\" background:#FFF; border:0; border-radius:3px; box-shadow:0 0 1px 0 rgba(0,0,0,0.5),0 1px 10px 0 rgba(0,0,0,0.15); margin: 1px; max-width:540px; min-width:326px; padding:0; width:99.375%; width:-webkit-calc(100% - 2px); width:calc(100% - 2px);\"&gt;&lt;div style=\"padding:16px;\"&gt; &lt;a href=\"https://www.instagram.com/reel/CiIuW9kpjF1/?utm_source=ig_embed&amp;amp;utm_campaign=loading\" style=\" background:#FFFFFF; line-height:0; padding:0 0; text-align:center; text-decoration:none; width:100%;\" target=\"_blank\"&gt; &lt;div style=\" display: flex; flex-direction: row; align-items: center;\"&gt; &lt;div style=\"background-color: #F4F4F4; border-radius: 50%; flex-grow: 0; height: 40px; margin-right: 14px; width: 40px;\"&gt;&lt;/div&gt; &lt;div style=\"display: flex; flex-direction: column; flex-grow: 1; justify-content: center;\"&gt; &lt;div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; margin-bottom: 6px; width: 100px;\"&gt;&lt;/div&gt; &lt;div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; width: 60px;\"&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div style=\"padding: 19% 