vidad, Meghan dio un discurso durante la tarde de este lunes 5 de septiembre en la cumbre <strong>One Young World</strong>, instancia que rene a jvenes lderes de todo el mundo que buscan soluciones a algunos problemas que afectan a la sociedad.</p><p style=\"margin-left:0px;\">PUBLICIDAD</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><h2 style=\"margin-left:0px;\"><strong>Se juntarn con William y Kate?</strong></h2><p style=\"margin-left:0px;\">La gran duda que ha dejado este viaje es si Harry y Meghan aprovecharn de juntarse con<strong> William y Kate</strong>, los futuros reyes de Inglaterra, con quienes han tenido una distante relacin desde que decidieron dejar la corona britnica.</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">De acuerdo a diferentes reportes de prensa ingleses, los hermanos no tendran ningn plan de reencontrarse, y es ms, Harry ni siquiera tendra ganas de ver a su familia.</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">Lo anterior, porque el tambin hijo de<strong> Diana de Gales</strong> decidi rechazar, junto a Meghan, la invitacin que le hizo su padre, <strong>el prncipe Carlos</strong>, a quedarse en la finca de Balmoral, prefiriendo hospedarse lejos, en otra residencia real.</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><h2 style=\"margin-left:0px;\"><strong>Por qu se niegan al reencuentro?</strong></h2><p style=\"margin-left:0px;\">La negativa al reencuentro no solo viene de Harry, sino que tambin de William y Kate, quienes estaran a la espera de que el renunciado miembro de la corona lance su libro de memorias y un documental de <strong>Netflix</strong>.</p><p style=\"margin-left:0px;\">Los herederos a la corona no estaran dispuestos a conversar con Meghan y Harry hasta que se publique el documento, ya que temen que cualquier conversacin pueda ser luego expuesta en el libro.</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><strong>\"Han perdido la oportunidad de que se confe en ellos, porque es probable que graben cualquier conversacin y la usen en su contra\"</strong>, seal la bigrafa real<strong>&nbsp;Angela Levin</strong> a The Sun.</p><p style=\"margin-left:0px;\">Durante este periplo por Inglaterra, se desconoce si es que Meghan y Harry tienen intenciones de visitar a la <strong>reina Isabel II</strong>. La informacin preliminar en la agenda de ambos que se hizo pblica, no contempla lo anterior.</p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26z498l7rxb1cc.jpg',1,'2022-09-07 17:57:32','2022-09-07 17:57:32',19,10),(40,'\"Nuestro segundo hogar\": Marit Matus preocupa tras subir un video con su hijo Alonso desde la clnica','\"nuestro-segundo-hogar\":-marite-matus-preocup','Un preocupante registro fue el que subi a sus redes sociales la influencer Mara Teresa \"Marit\" Matus, en el cual aparece su hijo adolescente Alonso \"Monito\" Vidal en la camilla de una clnica.','<p style=\"margin-left:0px;\">Un preocupante registro fue el que subi a sus redes sociales la influencer <a href=\"https://www.meganoticias.cl/temas/marit%C3%A9-matus/\"><strong>Mara Teresa \"Marit\" Matus</strong></a>, en el cual aparece su hijo adolescente&nbsp;<strong>Alonso \"Monito\" Vidal</strong>&nbsp;en la camilla de una clnica.</p><p style=\"margin-left:0px;\">Recordemos que el tambin hijo del futbolista <strong>Arturo Vidal</strong> tiene algunos problemas de salud, como <strong>diabetes</strong>, la cual se ha tratado con profesionales de primer nivel en Espaa y Chile. Es importante precisar, en todo caso, que esta vez Marit no detall si la internacin de Alonso tiene que ver con este diagnstico.</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><h2 style=\"margin-left:0px;\"><strong>\"Nuestro segundo hogar\"</strong></h2><p style=\"margin-left:0px;\">En horas de la maana de este lunes 5 de septiembre, Marit Matus subi un video a sus historias de Instagram, en el que aparece Alonso recostado sobre una camilla clnica.</p><p style=\"margin-left:0px;\">Sobre este clip, Matus escribi: <strong>\"Nuestro segundo hogar\"</strong>, junto a un emoji de una cara afligida, demostrando su sentimiento actual.</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p><span class=\"image-inline ck-widget image_resized ck-widget_with-resizer\" style=\"width:534px;\" contenteditable=\"false\"><img src=\"https://images2-mega.cdn.mdstrm.com/meganoticias/2022/09/05/388751_2_63162bccef685.png\" alt=\"Historia de Marit Matus\"><div class=\"ck ck-reset_all ck-widget__resizer\" style=\"display: none;\"><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-left\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-left\"></div><div class=\"ck ck-size-view\" style=\"display: none;\"></div></div></span></p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">Tras recibir una serie de mensajes por interno de parte de sus ms de 700 mil seguidores en Instagram, la influencer decidi subir una historia comunicando el estado de salud de su primognito.</p><p style=\"margin-left:0px;\"><strong>\"A todos los que me preguntan por la salud de Alonso, l est bien, gracias a Dios. Ya est estable. Gracias\"</strong>, redact la mujer, aclarando que su hijo se encuentra en buen pie de salud.</p><h2 style=\"margin-left:0px;\"><strong>Revisa la historia</strong></h2><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p><span class=\"image-inline ck-widget image_resized ck-widget_with-resizer\" style=\"width:534px;\" contenteditable=\"false\"><img src=\"https://images2-mega.cdn.mdstrm.com/meganoticias/2022/09/05/388751_1_63162ba8c9a39.jpg\" alt=\"Historia de Marit Matus\"><div class=\"ck ck-reset_all ck-widget__resizer\" style=\"display: none;\"><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-left\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-left\"></div><div class=\"ck ck-size-view\" style=\"display: none;\"></div></div></span></p><p style=\"margin-left:0px;\">Cabe precisar que Marit Matus es madre de 3 nios: <strong>Alonso, Emiliano y Elisabetta</strong>, todos fruto de su finalizado matrimonio con Arturo Vidal.</p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26z498l7rxf42g.jpg',1,'2022-09-07 18:00:43','2022-09-07 18:00:43',19,10),(41,'\"Las verdaderas jefas\": El tierno gesto de Daddy Yankee al bailar con una abuela durante su concierto','\"las-verdaderas-jefas\":-el-tierno-gesto-de-da','Daddy Yankee volvi a dar muestras del aprecio que siente hacia su fanaticada. El puertorriqueo sorprendi al pblico al bailar reguetn con una mujer de avanzada edad durante uno de sus conciertos.','<p style=\"margin-left:0px;\"><a href=\"https://www.meganoticias.cl/temas/Daddy-Yankee/\"><strong>Daddy Yankee</strong></a> volvi a dar muestras del aprecio que siente hacia su fanaticada. El puertorriqueo sorprendi al pblico al bailar reguetn con una mujer de avanzada edad durante uno de sus conciertos.</p><p style=\"margin-left:0px;\">El artista contina despidindose de los escenarios con su exitosa gira <a href=\"https://www.meganoticias.cl/tendencias/352854-daddy-yankee-se-retira-billboard-1ab.html\"><strong>La ltima Vuelta</strong></a> por <a href=\"https://www.meganoticias.cl/temas/estados-unidos/\"><strong>Estados Unidos</strong></a> y, al parecer, el boricua est disfrutando al mximo junto a su pblico.</p><p style=\"margin-left:0px;\">PUBLICIDAD</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">El <a href=\"https://www.meganoticias.cl/tendencias/379924-daddy-yankee-para-siempre-mireddys-gonzalez-1ab.html\"><strong>intrprete</strong></a>, que este mes estar ofreciendo varios shows en Chile, protagoniz un tierno momento cuando qued flechado por la energa de una mujer mayor que acudi a su presentacin.</p><h2 style=\"margin-left:0px;\"><strong>As bail Daddy Yankee con la abuela</strong></h2><p style=\"margin-left:0px;\"><a href=\"https://www.meganoticias.cl/tendencias/377611-daddy-yankee-hija-jesaaelys-ayala-gonzalez-botox-1ab.html\"><strong>Daddy Yankee</strong></a> estaba en plena puesta en escena cuando llam su atencin, en medio del pblico, una tierna seora de cabello blanco que bailaba una de sus canciones, imitando los efusivos pasos del gnero urbano.</p><p style=\"margin-left:0px;\">El cantante la invit a subir al escenario para bailar junto a ella el tema Hot, mientras el pblico gritaba y aplauda. El emocionante momento qued registrado en un video que fue compartido por el artista en sus redes sociales.</p><p style=\"margin-left:0px;\"><strong>Tenemos de todos los fans. Desde los ms chiquitos hasta las que son las verdaderas jefas.</strong> Yo me lo estoy disfrutando al 100%, se le escucha decir antes de comenzar a bailar con la abuelita.</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><code>&lt;blockquote class=\"tiktok-embed\" cite=\"https://www.tiktok.com/@daddyyankee/video/7139030657426050347\" data-video-id=\"7139030657426050347\" style=\"max-width: 605px;min-width: 325px;\" &gt; &lt;section&gt; &lt;a target=\"_blank\" title=\"@daddyyankee\" href=\"https://www.tiktok.com/@daddyyankee?refer=embed\"&gt;@daddyyankee&lt;/a&gt; Tenemos de todos los fans. Desde los ms chiquitos hasta las que son las verdaderas jefas. Connecticut estamos &lt;a title=\"hot\" target=\"_blank\" href=\"https://www.tiktok.com/tag/hot?refer=embed\"&gt;#hot&lt;/a&gt; &lt;a title=\"laultimavueltaworldtour\" target=\"_blank\" href=\"https://www.tiktok.com/tag/laultimavueltaworldtour?refer=embed\"&gt;#laultimavueltaworldtour&lt;/a&gt; &nbsp; &nbsp;&lt;a title=\"legendaddy\" target=\"_blank\" href=\"https://www.tiktok.com/tag/legendaddy?refer=embed\"&gt;#legendaddy&lt;/a&gt; &lt;a target=\"_blank\" title=\" HOT - Daddy Yankee &amp; Pitbull\" href=\"https://www.tiktok.com/music/HOT-7076523552128419841?refer=embed\"&gt; HOT - Daddy Yankee &amp; Pitbull&lt;/a&gt; &lt;/section&gt; &lt;/blockquote&gt; &lt;script async src=\"https://www.tiktok.com/embed.js\"&gt;&lt;/script&gt;</code></p><h2 style=\"margin-left:0px;\"><strong>Fans quedan enternecidos con el video</strong></h2><p style=\"margin-left:0px;\">Los fans de Daddy Yankee quedaron conmovidos ante el gesto del artista y dejaron cientos de mensajes en la publicacin, que ya alcanza ms de 200 mil reproducciones en <a href=\"https://www.meganoticias.cl/temas/tiktok/\"><strong>TikTok</strong></a>.</p><p style=\"margin-left:0px;\">Seora, quiero que sepa que vivi el sueo de muchos, me incluyo; Esa seora vivi mi sueo; La abuela reggetonera, qu hermosa es, qu espritu tiene. Excelente por ella que disfruta al mximo al jefe Daddy Yankee, fueron parte de algunas de las reacciones dejadas en la publicacin.</p><p style=\"margin-left:0px;\"><span class=\"image-inline ck-widget image_resized ck-widget_with-resizer\" style=\"width:534px;\" contenteditable=\"false\"><img src=\"https://images2-mega.cdn.mdstrm.com/meganoticias/2022/09/05/388777_2_6316561441876.jpg\" alt=\"\"><div class=\"ck ck-reset_all ck-widget__resizer\" style=\"display: none;\"><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-left\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-left\"></div><div class=\"ck ck-size-view\" style=\"display: none;\"></div></div></span></p>','https://chaimanoticias.s3.amazonaws.com/6dn26zm4ol7rxk47d.jpg',1,'2022-09-07 18:04:37','2022-09-07 18:04:37',19,10),(42,'Prensa brasilea se rinde ante el \"Rey Arturo\" y pide su titularidad en Copa Libertadores','prensa-brasilena-se-rinde-ante-el-\"rey-arturo','Arturo Vidal sigue brillando en Flamengo. El volante chileno le dio el domingo el triunfo al cuadro carioca al anotar el 1-0 con el que se impuso a Botafogo, por el Brasileirao.','<p style=\"margin-left:0px;\"><strong>Arturo Vidal</strong> sigue brillando en <strong>Flamengo</strong>. El volante chileno le dio el domingo el triunfo al cuadro carioca al anotar el 1-0 con el que se impuso a <strong>Botafogo</strong>, por el Brasileirao.</p><p style=\"margin-left:0px;\">Tras darle la victoria al \"Mengao\", la prensa brasilea llen de elogios al bicampen de Amrica con la Roja por su aporte al equipo, y comienzan a verlo como <strong>titular indiscutido</strong> en la escuadra estelar.</p><p style=\"margin-left:0px;\">Por ejemplo, el diario <strong>Lance</strong> le puso nota 7 y lo consider como una de las figuras del cotejo: \"Fue el motor del equipo en el medio. El chileno mostr oportunismo y marc el gol tras recibir un bonito pase de Pedro\".</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">\"Hroe en la victoria por 1-0 sobre Botafogo, el chileno pone cada vez ms \'la pulga atrs de la oreja\" de Dorival Jr. y levanta la pregunta:<strong> Ya es el momento de salir del equipo B y pasar a decir presente en el equipo en las competiciones muere-muere?</strong>\", se cuestion el mismo medio de cara al duelo del mircoles ante <strong>Vlez Sarsfield</strong>, por la ida de las semifinales de Copa Libertadores.</p><p style=\"margin-left:0px;\">En tanto, <strong>Globo Esporte</strong> tambin le dio la misma calificacin y sostuvo: \"Anot y encontr atajos para tener llegadas. Fue premiado con un gol dentro del rea pequea\".</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:0px;\">\"Contratado como el mayor nombre de Flamengo en la segunda ventana de transferencias, Arturo Vidal todava no consigue confirmar su nombre entre los titulares. De todos modos, el chileno muestra, juego tras juego, que vino a Brasil con el fin de jugar ftbol. Contra Botafogo, adems de comandar las construcciones ofensivas del equipo de Dorival Jr., Vidal fue el responsable de marcar el gol de la victoria... en su primer clsico en el pas\", agreg el medio Extra.</p><p style=\"margin-left:0px;\">El DT del \"Mengao\", <strong>Dorival Junior</strong>, no se qued atrs y expres: \"Lo cierto es que tenemos que estar tranquilos, Arturo Vidal ha sido importante en todos los partidos del equipo. El jugador chileno ha estado en la mayora de los partidos\".</p><p style=\"margin-left:0px;\">Con este triunfo, el <strong>Flamengo sum 43 puntos en el Brasileirao</strong> y qued a siete unidades del lder, el Palmeiras del defensor chileno Benjamn Kuscevic.</p><p style=\"margin-left:0px;\">Ahora el cuadro carioca deber enfocarse en el duelo de este mircoles como visita ante Vlez Sarsfield, por la ida de las semifinales de Copa Libertadores.</p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26zm4ol7rzn25b.jpg',1,'2022-09-07 19:02:52','2022-09-07 19:02:52',19,8),(43,'Elon Musk fracasa en su intento de retrasar el juicio contra Twitter, pero podr presentar nuevas pruebas','elon-musk-fracasa-en-su-intento-de-retrasar-e','La jueza de Delaware permite introducir como alegaciones las denuncias del anterior jefe de seguridad de la red social','<p style=\"margin-left:var(--grid-8-1-column-content-gap);\">Una de cal y otra de arena. La jueza del tribunal de Wilmington (Delaware) que dirimir si Elon Musk est obligado a comprar Twitter por 44.000 millones de dlares (una cantidad ligeramente superior en euros),&nbsp;<a href=\"https://elpais.com/economia/2022-04-25/twitter-y-elon-musk-llegan-a-un-acuerdo-para-la-compra-de-la-red-social-por-44000-millones-de-dolares.html\"><u>como haba acordado</u></a>, ha rechazado retrasar hasta noviembre el juicio contra la red social, como peda Elon Musk. En cambio, el hombre ms rico del mundo s que <a href=\"https://elpais.com/economia/2022-08-30/elon-musk-pone-una-nueva-excusa-para-cancelar-la-compra-de-twitter.html\"><u>podr introducir nuevos argumentos para la ruptura del acuerdo de compra</u></a>. Los abogados del magnate alegarn ahora los fallos denunciados por el antiguo jefe de seguridad de la red social, Peiter Zatko.</p><p style=\"margin-left:var(--grid-8-1-column-content-gap);\">La jueza Kathaleen St. Jude McCormick, de 42 aos, ha tomado la decisin despus de una vista en la que las dos partes expusieron sus posiciones este pasado martes. Ya anteriormente rechac los argumentos de los demandados en respuesta a la mocin de aceleracin de Twitter, dejando claro que cuanto ms se retrase el juicio, mayor ser el riesgo de dao irreparable para Twitter, reitera la jueza en su decisin. Y aade: Estoy convencida de que incluso un retraso de cuatro semanas supondra un riesgo de dao adicional para Twitter demasiado grande para justificarlo. El juicio, por tanto, sigue programado para la semana del 17 de octubre.</p><p style=\"margin-left:0px;\"><br data-cke-filler=\"true\"></p><p style=\"margin-left:var(--grid-8-1-column-content-gap);\">En el auto, de cinco pginas, la jueza indica que, por lo general, admite nuevas alegaciones siempre que est justificado, porque lo importante es fallar sobre el fondo de la cuestin. Twitter argumenta que la enmienda [a las alegaciones de Musk] sera intil, pero sus argumentos se tambalean frente a la norma, dice la jueza, que cree que las reglas procesales amparan que el magnate introduzca nuevos argumentos y pruebas. Soy reticente a decir ms sobre el fondo de las contrademandas en este momento antes de que se hayan litigado por completo. El mundo tendr que esperar a la decisin posterior al juicio, aade McCormick.</p><p style=\"margin-left:var(--grid-8-1-column-content-gap);\">En Estados Unidos, una de las partes de las demandas civiles es el llamado <i>discovery,</i> requerimientos por los que las partes deben facilitar incluso sus comunicaciones personales y su documentacin interna relativa al caso. La jueza permite ahora que se ejerza ese derecho en relacin con la nueva denuncia de Zatko, pero pide que se haga de forma gil.</p><h3 style=\"margin-left:var(--grid-8-1-column-content-gap);\"><strong>Una denuncia oportuna</strong></h3><p style=\"margin-left:var(--grid-8-1-column-content-gap);\">Con los argumentos iniciales para romper la operacin de adquisicin de Twitter, las cosas no pintaban demasiado bien para Musk. Sus argumentos sobre cuentas falsas parecan fabricados artificialmente para romper el acuerdo, ms que una genuina sorpresa que se hubiese llevado al analizar ms a fondo la compaa. La vista de este viernes dio una prueba ms de ello, pues los abogados de la red social leyeron un mensaje del propio Musk a un banquero de Morgan Stanley en el que ambos comentaban un discurso que iba a dar el presidente ruso, Vladmir Putin, y el magnate sealaba que no tendra sentido comprar Twitter si iba a estallar la tercera guerra mundial.</p><p style=\"margin-left:var(--grid-8-1-column-content-gap);\">Adems, Musk siempre se estaba quejando de que haba demasiados bots en Twitter, as que alegar luego que rompa el acuerdo porque haba descubierto de repente que haba demasiados bots no era muy convincente. Ese era, bsicamente, el argumento de la carta de ruptura que Musk envi el pasado 8 de julio y por el que le ha demandado Twitter para obligarle a comprar la red social. En el acuerdo de compra, adems, ni se mencionaba el asunto.</p><p style=\"margin-left:var(--grid-8-1-column-content-gap);\">De repente, <a href=\"https://elpais.com/tecnologia/2022-08-23/el-exjefe-de-seguridad-de-twitter-denuncia-que-la-compania-ha-ocultado-deficiencias-extremas-enormes.html\"><u>una denuncia de un antiguo empleado</u></a> de Twitter le ha venido a Musk como llovida del cielo. Peiter <i>Mudge</i> Zatko, un legendario <i>hacker</i> fichado por la compaa para encargarse de la seguridad y despedido en enero tras 15 meses en el cargo, acusa a la red social de ocultar deficiencias extremas, enormes a las autoridades federales de Estados Unidos sobre su lucha contra el <i>spam</i> en la plataforma, sus defensas contra<i> hackers</i> y el <i>software</i> que usan sus centros de datos. Los abogados de Musk, que ya han pedido una citacin para tomar declaracin a Zatko, enviaron una carta a Twitter en la que usan como nuevas excusas esas denuncias, relativas a la seguridad y la privacidad, principalmente, para romper el acuerdo de compra de la red social.</p><p style=\"margin-left:var(--grid-8-1-column-content-gap);\">Desde entonces han salido a la luz alegaciones relativas a ciertos hechos, conocidos por Twitter antes y a partir del 8 de julio de 2022, pero no revelados a Musk y sus socios antes y en ese momento, que proporcionan bases adicionales y distintas para rescindir el acuerdo de fusin, <a href=\"https://www.sec.gov/Archives/edgar/data/1418091/000110465922095765/tm2224790d1_ex99-q.htm\"><u>dice la segunda carta de ruptura enviada por los abogados del hombre ms rico del mundo.</u></a> Los letrados hacen algunos equilibrios. Dicen que esta carta no era necesaria porque la anterior ya era vlida para romper la fusin, pero que la envan para el caso de que se determine que la del 8 de julio es invlida por cualquier motivo.</p><p style=\"margin-left:var(--grid-8-1-column-content-gap);\">La jueza McCormick ha admitido finalmente que se estudien tambin estas alegaciones, pero los abogados van a tener que trabajar a toda prisa, porque lo que ella no quiere es retrasar el juicio ni siquiera a noviembre, como haba solicitado Musk.</p><p style=\"margin-left:var(--grid-8-1-column-content-gap);\">El pleito se dirime en un juzgado de equidad de Wilmington, en el Estado de Delaware, la capital empresarial de Estados Unidos, que ofrece una fiscalidad ventajosa y una regulacin flexible. <a href=\"https://elpais.com/economia/2022-08-15/twitter-contra-elon-musk-cuenta-atras-para-el-pleito-del-siglo.html#?rel=mas\"><u>El Tribunal de la Cancillera de Delaware forma parte de ese ecosistema.</u></a> Se cre en 1792, poco despus de la independencia de Estados Unidos, y en el ltimo siglo se ha convertido en rbitro de las grandes disputas corporativas estadounidenses. Sus jueces estn especializados en asuntos mercantiles y las empresas los prefieren. Ha dirimido batallas empresariales de gran calibre, opas, fusiones y demandas de todo tipo.</p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26zm4ol7s3vpmt.jpg',1,'2022-09-07 19:13:05','2022-09-07 21:01:34',19,15),(44,'Las estaciones del Metro de Santiago que estn cerradas por manifestaciones estudiantiles','las-estaciones-del-metro-de-santiago-que-esta','Al menos tres estaciones se encuentran interrumpidas debido a esta situacin, obligando al cierre de sus accesos y sin detencin de trenes.','<p>Durante la tarde de este mircoles comenzaron a registrarse diversas <strong>manifestaciones estudiantiles en estaciones del Metro de Santiago</strong>, llevando a que el servicio sea interrumpido en diferentes lneas del tren subterrneo.</p><p>Segn lo informado por la empresa en redes sociales, la primera en resultar afectada fue la <a href=\"https://www.chvnoticias.cl/nacional/estacion-santa-ana-metro-cerrada-personas-sentadas-borde-anden_20220907/\">estacin Santa Ana</a>, de la Lnea 5 y 2.</p><p>De acuerdo con lo especificado, dicha situacin se produjo por<strong> personas sentadas al borde del andn</strong>, llevando a que se mantenga sin detencin de trenes y con sus accesos cerrados (excepto el acceso en Lnea 5).</p><p><br data-cke-filler=\"true\"></p><p>A esa suspensin se sumaron <strong>diversas estaciones que cerraron sus puertas</strong>, sin embargo, a las 15:37 Metro inform que solo <strong>Los Hroes y Santa Isabel permanecen cerradas.</strong></p><p><span style=\"background-color:rgb(255,255,255);color:rgb(136,153,166);\"><code>&lt;blockquote class=\"twitter-tweet\"&gt;&lt;p lang=\"es\" dir=\"ltr\"&gt;15:37 Las estaciones que permanecen cerradas debido a interrupciones generadas por estudiantes son: &lt;br&gt;&lt;br&gt;?Los Hroes &lt;a href=\"https://twitter.com/hashtag/L1?src=hash&amp;amp;ref_src=twsrc%5Etfw\"&gt;#L1&lt;/a&gt; y &lt;a href=\"https://twitter.com/hashtag/L2?src=hash&amp;amp;ref_src=twsrc%5Etfw\"&gt;#L2&lt;/a&gt; (Habilitada solo para combinar)&lt;br&gt;&lt;br&gt;?Santa Isabel &lt;a href=\"https://twitter.com/hashtag/L5?src=hash&amp;amp;ref_src=twsrc%5Etfw\"&gt;#L5&lt;/a&gt; (cerrada y sin detencin de trenes)&lt;br&gt;&lt;br&gt;Seguiremos informando ?&lt;/p&gt;&amp;mdash; Metro de Santiago - #NuevoViaje (@metrodesantiago) &lt;a href=\"https://twitter.com/metrodesantiago/status/1567597954613055488?ref_src=twsrc%5Etfw\"&gt;September 7, 2022&lt;/a&gt;&lt;/blockquote&gt; &lt;script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"&gt;&lt;/script&gt;</code></span></p><p><br data-cke-filler=\"true\"></p><p><span style=\"background-color:rgb(255,255,255);color:rgb(136,153,166);\"><code class=\"ck-code_selected\">&lt;blockquote class=\"twitter-tweet\"&gt;&lt;p lang=\"es\" dir=\"ltr\"&gt;14:48 hrs. Santa Isabel &lt;a href=\"https://twitter.com/hashtag/L5?src=hash&amp;amp;ref_src=twsrc%5Etfw\"&gt;#L5&lt;/a&gt; se encuentra cerrada y sin detencin de trenes por manifestaciones en el interior de la estacin. Seguiremos informando&lt;/p&gt;&amp;mdash; Metro de Santiago - #NuevoViaje (@metrodesantiago) &lt;a href=\"https://twitter.com/metrodesantiago/status/1567585614416986114?ref_src=twsrc%5Etfw\"&gt;September 7, 2022&lt;/a&gt;&lt;/blockquote&gt; &lt;script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"&gt;&lt;/script&gt;</code></span></p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26zm4ol7s1fgz3.jpg',1,'2022-09-07 19:52:58','2022-09-07 19:52:58',19,9),(45,'Dramtico rescate de perrita sepultada hasta el cuello con sus cachorros en Turqua','dramatico-rescate-de-perrita-sepultada-hasta-','El registro fue compartido por el veterinario que se encontr con el animal en apuros en una granja. \"Estaban bajo tierra, cont.','<p>El video de un <strong>rescate de una </strong><a href=\"https://www.chvnoticias.cl/search/perro/\">perrita</a>an<strong> se ha vuelto viral</strong> durante las ltimas semanas no slo por lo dramtico de la gesta, sino por el <strong>conmovedor hallazgo que se hace al final.</strong></p><p>El registro corresponde al operativo que lider un veterinario llamado<strong> Soner Bymez</strong>, en una granja en <a href=\"https://www.chvnoticias.cl/search/turquia/\">Turqua</a>, a principios de agosto de este ao.</p><p>Las imgenes muestran a la can <strong>sepultada hasta el cuello, slo con la cabeza en la superficie</strong>, mientras un persona usa una pala para intentar liberarla.</p><p><br data-cke-filler=\"true\"></p><p>De acuerdo a lo relatado por el profesional a <a href=\"https://www.thedodo.com/daily-dodo/rescuer-finds-dog-buried-up-to-her-neck-then-realizes-shes-not-alone\">The Dodo</a>, un sitio dedicado al mundo <a href=\"https://www.chvnoticias.cl/search/animal/\">animal</a>, lo primero que llam su atencin fue el<strong> ruido de gemidos en las cercanas.</strong></p><p>Es por eso que<strong> corr inmediatamente al lugar, donde se dio cuenta que hubo un deslizamiento de tierra</strong>. Vi un perro atrapado en el suelo.</p><p>Tras dar excavar unos minutos, se dio cuenta de&nbsp;<strong>otros ruidos que inicialmente lo aterrorizaron y que, tras el shock, le hizo apurar el paso</strong>.</p><p><br data-cke-filler=\"true\"></p><p><br data-cke-filler=\"true\"></p><p><strong>Escuch el llanto de los cachorros Estaban bajo tierra</strong>, cont.</p><p>Al cabo de unos segundos, al continuar cavando, <strong>se encontr con siete cachorros</strong> que tambin haban sido enterrados vivos, luego de que su madriguera se derrumbara.</p><p><strong>Su estado general es muy bueno. La madre y sus cachorros estn protegidos Los cuidar como si fueran mos</strong>, concluy.</p><h2><strong>Revisa el rescate ac:</strong></h2><p><span style=\"background-color:rgb(255,255,255);color:rgb(136,153,166);\"><code class=\"ck-code_selected\">&lt;blockquote class=\"twitter-tweet\"&gt;&lt;p lang=\"tr\" dir=\"ltr\"&gt;&lt;a href=\"https://twitter.com/hashtag/Kayseri?src=hash&amp;amp;ref_src=twsrc%5Etfw\"&gt;#Kayseri&lt;/a&gt; &lt;a href=\"https://twitter.com/hashtag/Develi?src=hash&amp;amp;ref_src=twsrc%5Etfw\"&gt;#Develi&lt;/a&gt; Yaatmak iin youn aba harcayan &lt;a href=\"https://twitter.com/hashtag/VeterinerSa%C4%9Fl%C4%B1kTeknikeri?src=hash&amp;amp;ref_src=twsrc%5Etfw\"&gt;#VeterinerSalkTeknikeri&lt;/a&gt; meslektam Soner BYMEZ&amp;#39;e teekkr ediyorum. &lt;a href=\"https://t.co/kUBSSHU94z\"&gt;pic.twitter.com/kUBSSHU94z&lt;/a&gt;&lt;/p&gt;&amp;mdash; Mustafa AHN (@MstafaSahin44) &lt;a href=\"https://twitter.com/MstafaSahin44/status/1556718810652082176?ref_src=twsrc%5Etfw\"&gt;August 8, 2022&lt;/a&gt;&lt;/blockquote&gt; &lt;script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"&gt;&lt;/script&gt;</code></span><br><br data-cke-filler=\"true\"></p>','https://chaimanoticias.s3.sa-east-1.amazonaws.com/6dn26zm4ol7s1ibnd.png',1,'2022-09-07 19:55:12','2022-09-07 19:55:12',19,7);
